"l10325":{"C":"根据国家相关法律法规的规定，为维护双方利益，规范双方行为，甲乙双方本着自愿、平等、互利的原则，就客户（以下简称“甲方”）使用中国银行股份有限公司（以下简称“乙方”）网上银行理财直付服务签订如下协议："},
"l10326":{"C":"第一条 乙方提供的理财直付服务是指甲方签约成为乙方的网上银行客户后，开通了理财直付功能之后，甲方在理财产品商户网站（如销售基金、保险等产品的网站，简称“商户”）上购买理财产品并直接完成订单支付或身份认证的中间业务服务。"},
"l10327":{"C":"1.提供订单支付服务：乙方进行本协议约定的身份认证后，核实由商户系统发出的甲方支付指令是否在甲方设置的理财直付限额内，按照该支付指令实时扣减甲方指定的理财直付账户余额，进行支付。"},
"l10328":{"C":"2.提供身份认真服务：甲方开通理财直付服务后，甲方在商户网站进行与乙方理财直付相关的签约、密码修改等交易时，乙方协助商户对甲方的身份进行验证（该身份验证仅限于验证甲方是否为乙方网银客户、甲方的姓名、证件类型、证件号码与甲方在乙方网站注册信息是否一致）。"},
"l10329":{"C":"第二条 甲方申请使用乙方的理财直付功能必须首先成功申请成为乙方网上银行的客户，并已经申请了乙方指定的网上银行认证工具。甲方通过乙方理财直付所进行的一切经过认证工具认证后的交易，乙方均视为甲方亲自办理。甲方不得要求变更或撤销已经提交的电子支付指令。请甲方在开通理财直付服务后，认真阅读相关的安全提示。"},
"l10330":{"C":"第三条 甲方开通理财直付时应设置预留信息，并按照乙方的业务要求指定用于理财直付的合法账户和转账限额，乙方仅在上述指定账户和限额内向甲方提供理财直付服务；甲方开通理财直付短信通知服务的，其指定的短信手机号码应为境内合法手机号码（不包括小灵通号码），并能够正常接收短信。可用于理财直付的账户包括甲方在网银中所有已关联的长城电子借记卡和长城人民币信用卡。其中，使用长城人民币信用卡进行理财直付时不可透支。"},
"l10331":{"C":"第四条 甲方应保证用于理财直付的账户的支付能力，并严格遵守支付结算业务的相关法律法规。"},
"l10332":{"C":"第五条 如因甲方指定的理财直付账户已销户或账户状态不正常（挂失、冻结）、余额不足、支付金额高于设置的限额等原因，导致乙方无法履行协议的，乙方不承担任何责任。"},
"l10333":{"C":"第六条 甲方与除甲乙双方之外的任何第三方机构（包括甲方所购买理财产品或服务的销售方等）之间的交易纠纷与乙方无关。乙方不受理甲方对其他任何第三方的投诉。"},
"l10334":{"C":"第七条 乙方可以自主根据业务发展需要增加、删除或变更合作的理财产品商户。甲方有权据此选择是否使用乙方提供的理财直付服务。"},
"l10335":{"C":"第八条 甲方通过在网上同意本协议并经过认证工具的认证后开通理财直付功能；甲方如需终止使用乙方提供的理财直付服务，可通过点击相关页面的取消功能撤销理财直付服务。"},
"l10336":{"C":"无持仓信息"},
"l10337":{"C":"第九条 本协议作为甲乙双方已经签署的电子银行（含网上银行）相关协议及其他既有协议和约定的补充部分而非替代文件，与其具有同样的法律效力。甲方在使用乙方提供的服务时应遵守电子银行章程、业务规则和已签署的所有相关协议，以及其他相关的业务规定。"},
"l10338":{"C":"第十条 甲方发现自身未按规定操作，或由于自身其他原因造成理财直付指令未执行、未适当执行、延迟执行的，应及时通过拨打服务热线或到营业网点通知乙方。乙方应积极调查并告知甲方调查结果。"},
"l10339":{"C":"第十一条 因不可抗力、意外事件、不可预见的系统故障或其他非乙方原因（设备故障、通讯线路故障及断电、停电等）造成的乙方没有正确执行甲方提交的理财直付指令或业务中断，乙方不承担任何责任。"},
"l1033":{"C":"参考净值"},
"l10340":{"C":"第十五条 乙方变更业务或根据发展需要修改本协议的，乙方将通过适当方式（如电子银行渠道等）提前公告。若甲方不同意此修改，有权撤销本服务。若甲方仍继续使用本服务的，视为甲方接受该变更或修改。"},
