"l1252":{"C":"申请人自愿申请开通中国银行网上银行查询服务，完全接受并遵守《中国银行股份有限公司电子银行章程》（以下简称章程）、《中国银行股份有限公司网上银行个人服务业务规则》等相关业务规定，经中国银行审核通过后，有权根据注册项目使用网上银行查询服务。"},
"l1253":{"C":"申请人已完全了解网上银行服务是中国银行应用互联网方式提供的金融服务，申请人通过互联网使用网银服务可能会出现信息传送中断、停顿、延误、传送数据错误或存在一定的时差等情况，因上述情况造成网上银行服务被取消、暂停或终止，申请人可自行采取其它途径获取相关服务。"},
"l1254":{"C":"电话"},
"l1255":{"C":"申请人必须保证其用于申请开办网上银行业务的资料均属真实、准确和完整。对于申请人未提供真实、准确、完整的资料或资料发生任何变更而没有及时通知中国银行而造成的风险和损失由申请人承担。"},
"l1256":{"C":"申请人必须妥善保管用户名、密码等信息。凡通过以上信息完成的网上银行服务指令，均视为申请人本人所为。因申请人未妥善保管上述信息造成的损失，申请人承担相应责任。"},
"l1257":{"C":"申请人应在中国银行规定的服务时间内使用网上银行服务。"},
"l1258":{"C":"中国银行应当保障网上银行系统设施设备以及安全控制设施设备的安全，对网上银行的重要设施设备和数据采取适当保护措施。在中国银行履行上述合理义务前提下，因通讯线路故障、网络故障及断电、停电、病毒爆发或交易中偶发因素产生的不可预测、不可控制、不可抗力以及其他非因中国银行原因造成申请人损失的，中国银行不承担责任。"},
"l1259":{"C":"因中国银行对银行系统进行升级、改造而引起的服务取消、暂停或者客户账号、服务内容、项目、方式等变化，或根据业务发展需要修改本协议、收费标准或其他业务规则，中国银行将在中国银行营业网点、中国银行网站【http://www.boc.cn】等提前进行公告。 若申请人有异议，有权选择注销本服务，若申请人未注销本服务或继续接受本服务的，视为同意并接受该变更，申请人办理相关业务按变更后的内容执行。"},
