"l15226":{"C":"在办理澳洲留学汇款时，如属于交学费或其他有关费用，则本栏位填写内容应包括：学生姓名、学生号码、出生日期或其他付费用途。如费用为汇往中介服务公司或留学服务公司，应补充说明学校名称及学科。"},
