"l15231":{"C":"说明：如果您选择开通储蓄国债（电子式）服务功能须遵守《中国银行股份有限公司电子银行储蓄国债（电子式）业务章程》。"},
"l15232":{"C":"中国银行股份有限公司电子银行储蓄国债（电子式）业务章程"},
"l15233":{"C":"第一条 中国银行股份有限公司（以下简称“我行”）根据财政部、中国人民银行《储蓄国债（电子式）代销试点管理办法(试行)》和中央国债登记结算有限责任公司《储蓄国债（电子式）代销试点业务实施细则（试行）》的规定，特制定本章程。请投资者认真阅读该章程。"},
"l15234":{"C":"第二条 我行在储蓄国债(电子式)（以下简称“储蓄国债”）柜台营业时间内，通过中国银行电子渠道为已开立资金账户的个人投资者提供以下服务："},
"l15235":{"C":"（一）投资者自愿委托我行进行债券托管，我行通过电子渠道为其开立储蓄国债托管账户，并办理债券托管、结算及相关业务；"},
"l15236":{"C":"（二）通过投资者指定的资金账户为投资者办理与储蓄国债相关的资金清算；"},
"l15237":{"C":"（三）代理销售储蓄国债；"},
"l15238":{"C":"（四）试点销售期间暂不允许客户通过电子渠道办理储蓄国债提前兑付、质押贷款、非交易过户、更改客户资料、开立存款证明、打印国债业务对账单；"},
"l15239":{"C":"（五）电子渠道提供各类国债信息查询等服务；"},
"l1523":{"C":"附属卡交易短信发送方式信息如下，请确认。"},
"l15240":{"C":"（六）储蓄国债的付息和还本付息。"},
"l15241":{"C":"第三条 我行依法为投资者保密，不向第三人提供查询、冻结、扣划投资者债券等服务，法律、法规另有规定的除外。"},
"l15242":{"C":"第四条 储蓄国债业务涉及的收费项目和标准按财政部及我行对外公布的服务收费业务价格表执行。"},
"l15243":{"C":"第五条 投资者开立债券托管账户采用实名制，应保证开户资料填写的真实、正确、完整、有效，当有关资料发生变化时，须及时到我行柜台办理更改手续。因提供资料有误或未及时办理资料变更手续而导致的风险和损失由投资者自行承担。"},
"l15244":{"C":"第六条 投资者开立储蓄国债托管账户时，须同时指定一个本人在我行开立的个人结算账户（包括借记卡、凭密码支取的普通活期存折或活期一本通存折）作为资金账户。"},
"l15245":{"C":"第七条 投资者应妥善保管本人网银用户名、密码及电子认证工具，避免遗失及泄密，凡按规定持网银用户名、密码及电子认证工具办理的各项储蓄国债业务，我行均视为投资者本人办理。"},
"l15246":{"C":"第八条 因不可抗力事件对客户造成的损失，按照法律有关规定处理。本章程未尽事宜，按照有关法律法规、中国人民银行、财政部、中央国债登记结算有限责任公司相关规定办理。"},
"l15247":{"C":"第九条 本章程修改或我行系统升级、业务变化、收费变更，将提前通过我行营业网点、门户网站（www.boc.cn）进行公告。投资者有异议的，有权选择注销本服务，若投资者未注销本服务或继续接受本服务的，视为同意接受该修改，相关业务按修改后的内容执行。"},
"l15248":{"C":"操作"},
"l15249":{"C":"本人（甲方）已仔细阅读并理解＂"},
"l1524":{"C":"如果影响您风险承受能力的因素发生变化，请及时完成风险承受能力评估。"},
"l15250":{"C":"＂，完全同意和接受协议书全部条款和内容，愿意履行和承担该协议书中约定的权利和义务。"},
