"l15255":{"C":"如果您已加入全球账户管理，可通过“全球服务—账户关联”服务将本地网银账户与全球账户管理服务进行关联。"},
"l15256":{"C":"个人客户使用动态口令作为信用卡网上支付3D安全认证工具服务协议"},
"l15257":{"C":"第一条  甲方确认，将乙方提供的动态口令设置为网上支付3D安全认证工具。当甲方持乙方发行的信用卡在VISA、MasterCard、JCB等与乙方合作的国际卡组织的境外网络商户进行网上支付交易时，乙方对甲方提交的动态口令进行检验，检验无误后根据甲方提交的电子支付指令进行资金支付。相关国际卡组织的具体范围由乙方根据业务发展需要确定。"},
"l15258":{"C":"第二条  动态口令，又称动态密码，是依据客户私人身份信息并引入不确定因素产生随机变化的口令，使客户每次使用的密码具有动态变化性和不可预知性。"},
"l15259":{"C":"第三条  甲方通过乙方网上支付3D安全认证所进行的一切经过认证后的交易，乙方均视为甲方亲自办理。甲方不得要求变更或撤销已经过认证的电子支付指令。甲方应妥善保管其动态口令牌，由于动态口令牌遗失导致第三人伪冒交易从而给甲方造成资金损失的，乙方不承担责任。"},
"l1525":{"C":"附属卡交易短信发送方式设置成功。"},
"l15260":{"C":"第四条  甲方进行的网上支付交易应符合法律法规及乙方的业务要求。"},
"l15261":{"C":"第五条 乙方保证具有提供信用卡网上支付3D安全认证服务的能力，严格遵守法律法规和相关业务规则。"},
"l15262":{"C":"第六条 如因甲方指定账户已销户或账户状态不正常（挂失、冻结）、余额不足等原因，导致乙方无法执行甲方的电子支付指令的，乙方不承担任何责任。"},
"l15263":{"C":"第七条 甲方与除甲乙双方之外的任何第三方机构（包括第三方支付平台、甲方所购买商品或服务的销售方、商品配送方等）之间的交易纠纷与乙方无关。乙方不受理甲方对其他任何第三方的投诉。"},
"l15264":{"C":"第八条 甲方有权解除本协议。甲方通过乙方分支机构柜台或网上银行提出解除动态口令作为网上支付3D安全认证工具的申请，经乙方确认后本协议解除。"},
"l15265":{"C":"第九条 甲方发现自身未按规定操作，或由于自身其他原因造成网上支付3D安全认证未执行、未适当执行、延迟执行的，应及时通过拨打服务热线通知乙方。乙方应积极调查并告知甲方调查结果。"},
"l15266":{"C":"第十条 因不可抗力或其他非乙方原因（设备故障、通讯线路故障及断电、停电等）造成的服务未成功或业务中断，乙方不承担任何责任。"},
"l15267":{"C":"第十一条 甲乙双方在履行本协议的过程中，如发生争议应协商解决，协商不成的，按照双方已经签署的《中国银行股份有限公司信用卡领用合约》中的约定方式解决。"},
"l15268":{"C":"第十二条 本协议的成立、生效、履行和解释，均适用中华人民共和国法律；法律无明文规定的，可适用通行的金融惯例。"},
"l15269":{"C":"第十三条 本协议自甲方签字/甲方点击“接受”签约按钮，并经乙方确认后生效，至甲方解除服务时终止。所有时点均以乙方系统记录的时间为准。"},
"l1526":{"C":"新增定期存款"},
"l15270":{"C":"第十四条 甲乙双方已就本协议内容进行了充分的沟通，甲方已向乙方就本协议内容进行了全面准确的解释和说明，乙方完全了解本协议并且自愿遵照执行上述约定。"},
"l15271":{"C":"为维护双方利益，规范双方行为，甲乙双方本着自愿、平等、互利的原则，就以动态口令作为信用卡网上支付3D安全认证工具的服务事宜签订如下协议："},
