"l15406":{"C":"第十一条  本协议自甲方签字、乙方盖章后生效。如甲方通过电子银行渠道办理本协议项下业务，则本协议自甲方向乙方申请并经乙方系统确认后生效。本协议有效期为一年。在有效期满前30天，如任何一方未向对方提出终止协议的要求，本协议自动展期一年。上述展期不受次数限制。"},
