"l15684":{"C":"尊敬的客户，现在是大额跨行汇款非工作时间。如您选择继续汇款，系统将预约在当日工作时间自动汇划处理。请确认工作日扣款时，账户资金充足。"},
"l15685":{"C":"尊敬的客户，现在是大额跨行汇款非工作时间。如您点击\"预约\"按钮，该笔转账将自动转为预约任务在下一个工作日处理，相关款项将在转账时从账户余额中扣除。切勿重复汇款！"},
