"l20924":{"C":"第六条 甲方使用信用卡虚拟卡进行支付，将直接占用甲方申请该虚拟卡时所指定的实体卡的信用额度。甲方使用借记卡虚拟卡进行支付，将直接使用甲方申请该虚拟卡时所关联的实体卡内账户资金。甲方应保证实体卡的支付能力，并严格遵守支付结算业务的相关法律法规，不得利用网上支付业务服务或账户从事任何欺诈、洗钱、恐怖融资等违反法律、法规、监管规定的行为。如甲方违反上述约定，乙方有权中止或终止虚拟卡服务，因此给乙方造成损失的，甲方应予赔偿。"},
"l20925":{"C":"甲方每个实体信用卡账户最多同时拥有20张有效信用卡虚拟卡，每个实体借记卡账户最多同时拥有5张有效借记卡虚拟卡。如甲方超出上述限制，乙方有权拒绝甲方申请。"},
"l20926":{"C":"甲方已申请的信用卡虚拟卡在过期或进行注销后，如信用卡虚拟卡未进行过金融交易，乙方有权在信用卡虚拟卡过期或注销后，对乙方的信用卡虚拟卡卡号进行永久性删除。如甲方所申请的信用卡虚拟卡进行过金融交易，则乙方将在信用卡虚拟卡过期或甲方进行注销后，保留信用卡虚拟卡卡号180天后再对信用卡虚拟卡卡号进行永久性删除。"},
"l20927":{"C":"甲方应在乙方规定的限额内设置单笔交易限额（仅限信用卡虚拟卡），以及日累计交易限额。如果甲方在支付过程中超出交易限额，该笔交易将无法完成支付。"},
"l20928":{"C":"甲方使用信用卡虚拟卡进行支付后，交易金额将在甲方办理信用卡虚拟卡时指定的实体卡账户内记账，甲方应按乙方的信用卡还款约定向实体卡直接进行还款。甲方使用借记卡虚拟卡进行支付，交易款项直接从甲方办理借记卡虚拟卡时指定的借记卡实体卡账户中扣款。"},
"l20929":{"C":"本协议作为甲乙双方已经签署的信用卡领用合约、借记卡章程及其他既有协议和约定的补充部分而非替代文件，与其具有同样的法律效力。甲方在使用乙方提供的服务时应遵守相关信用卡领用合约、信用卡章程、借记卡章程、电子银行章程和已签署的其他所有相关协议及约定。"},
