"l20930":{"C":"甲乙双方在履行本协议的过程中，如发生争议应协商解决，协商不成的，任何一方均可向甲方申请关联信用卡实体卡或借记卡实体卡的乙方分支机构所在地人民法院提起诉讼。"},
"l20932":{"C":"本协议自甲方向乙方申请并经乙方批准后开通虚拟卡服务之时起生效，自撤销虚拟卡功能服务之时起终止。所有时点均以乙方业务系统记录的时间为准。协议终止并不意味着终止前所发生的未完成交易指令的撤销，也不能消除因终止前的交易所带来的任何法律后果。"},
