"l21455":{"C":"第四条 鉴于不同基金的交易规则并不完全相同，甲方通过填写网上银行所申请办理的相关基金业务及相关手续，可能只被基金管理公司部分接受，甲方某些申请事项可能会因不符合某些基金管理公司规定要求而被拒绝接受，甲方在填写各种基金业务申请之前，应仔细了解甲方申请交易的基金的交易规则，并且同意承担申请事项因不符合基金管理公司规定要求而被拒绝接受的全部后果。对申请中被接受的申请事项视为甲方的要约被接受。"},
