"l21478":{"C":"试算规则 （1）买入金额是指认购、申购、定投申购、转换转入、转托管转入、非交易过户转入的基金金额（含手续费）； （2）卖出金额是指赎回、转换转出、转托管转出、非交易过户转出的基金金额净额（不含赎回手续费）； （3）交.易费用是指在基金产品买卖过程中，销售机构依据实际约定的手续费率提取的手续费佣金； （4）已实现盈亏=现金红利收益+累计卖出份额*（卖出份额净均价-买入份额成本均价）； （5）持仓盈亏=期末持仓份额*（期末净值-买入份额成本均价）； （6）总盈亏=持仓盈亏+已实现盈亏=期末市值-期初市值+卖出净金额-买入总金额； （7）买入份额成本均价=｛期初市值+期间净值类交易确认金额+份额类交易确认份额*确认日基金净值｝/｛期初份额+期间累计买入份额+期间累计转入份额+分红再投资份额｝； （8）卖出份额净均价={（累计赎回金额-累计赎回费用）+（累计转出、转托管、非交易过户份额、强减份额*当天成交净值）}/累计交易份额。"},
