"l21535":{"C":"第十一条 为保证跨境电子商务外汇支付交易正常开展，根据国家外汇管理局有关支付机构校验银行支付账户开户人信息与客户身份信息一致性的要求，客户授权银行为上述一致性校验之目的，将必要的支付账户开户人信息的核对结果反馈给支付机构。同时，为保证客户网上支付交易安全，银行将根据风险管理需要对网上支付交易进行监控，并对相关可疑和欺诈支付交易采取交易终止、交易重新确认或风险提示等处置措施。"},
