"l21545":{"C":"八、乙方按照甲方通过第三方机构提交的付款请求付款后，甲方对付款金额、付款次数或者付款金额与发票金额不符等因甲方或收款方造成的问题提出异议的，甲方应向收款方进行查询。因所付款项发生争议或因付款信息错误造成错付款项的，由甲方与收款方自行协商解决。"},
"l21546":{"C":"十、本协议如与国家新颁布的法律、法规、条例等相抵触，以国家新颁布的法律、法规、条例为准。甲乙双方应依据新颁布的法律、法规、条例等对协议内容及时进行相应调整。如因相关法律、法规、监管规定等变化导致本协议无法履行的，任何一方均有权解除本协议。乙方解除本协议的，可以公告或其他双方约定的形式通知甲方。本协议所称“公告”指在中国银行营业网点及门户网站【http://www.boc.cn】等进行公告。"},
"l21547":{"C":"十一、本协议自甲方点击“同意签约”按钮后生效，至本协议有效期届满、或本协议被解除时终止。所有时点均以中国银行网上银行系统记录的时间为准。协议终止并不意味着终止前所发生的未完成交易指令的撤销，也不能消除因终止前的交易所带来的任何法律后果。"},
