"l21557":{"C":"十二、本协议作为甲乙双方已经签署的关于电子银行及网上银行业务的既有协议和约定的补充部分而非替代文件，与其具有同样的法律效力。甲方在使用乙方提供的服务时应遵守《中国银行股份有限公司电子银行章程》、《中国银行股份有限公司网上银行个人服务业务规则》和已签署的所有相关协议，以及其他相关的业务规定。"},
"l21558":{"C":"一、甲方通过乙方网上银行服务为指定付款账户（户名： {0} 账号：{1}）开通支付在线认证功能后，授权乙方在接收到甲方通过第三方机构发送的付款请求时，通过在线认证的方式从该指定付款账户进行支付，从而实现货币的支付与资金转移。"},
"l21559":{"C":"三、甲方应保证本协议中所填信息的真实、有效、完整。因本协议中甲方提供信息有误造成的责任和损失由甲方自行承担。甲方应注意核实第三方机构的准确网址及第三方机构的资质状况及其网站的真实性，确保准确登陆第三方机构网站。甲方应注意核实并确保其所提交的交易信息、付款信息的准确性。"},
