"l21562":{"C":"四、用户名、密码和动态口令是乙方通过在线认证方式按相关付款请求进行支付的重要依据，甲方应妥善保管且不得向他人披露。凡通过乙方在线认证的以甲方用户名、密码和动态口令所进行的一切交易，均视为甲方亲自办理，所产生的电子信息记录为该项交易的合法有效凭据，甲方应对该交易负责。甲方不得要求变更或撤销已经提交的电子支付指令。因甲方对用户名、密码和动态口令保管不善或泄密造成的任何损失由甲方自行承担。"},
