"l21601":{"C":"第十五条 本协议自甲方在网上同意并经过认证工具的认证后开通电子支付功能之时起生效，自撤消本服务之时起终止。所有时点均以中国银行网上银行系统记录的时间为准。协议终止并不意味着终止前所发生的未完成交易指令的撤销，也不能消除因终止前的交易所带来的任何法律后果。"},
"l21602":{"C":"十、本协议如与国家新颁布的法律、法规、条例等相抵触，以国家新颁布的法律、法规、条例为准。甲乙双方应依据新颁布的法律、法规、条例等对协议内容及时进行相应调整。如因相关法律、法规、监管规定等变化导致本协议无法履行的，任何一方均有权解除本协议。"},
"l21603":{"C":"甲方不得要求变更或撤销已经提交的电子支付指令。"},
"l21604":{"C":"四、用户名、密码和动态口令是乙方通过在线认证方式按相关付款请求进行支付的重要依据，甲方应妥善保管且不得向他人披露。"},
