"l2830":{"C":"根据国家相关法律法规的规定，为维护双方利益，规范双方行为，甲乙双方本着自愿、平等、互利的原则，就客户（以下简称“甲方”）使用中国银行股份有限公司（以下简称“乙方”）网上银行支付服务（简称“电子支付”）签订如下协议："},
"l2831":{"C":"第一条 乙方提供的电子支付服务是指甲方签约成为乙方的网上银行客户后，开通了电子支付的功能，在电子商务网站上购买商品或服务，然后通过互联网络向乙方发出支付指令，实现货币的支付与资金转移。"},
"l2832":{"C":"第三条 甲方在签订本协议后，应按照乙方的业务要求指定用于电子支付的合法账户。"},
"l2833":{"C":"第四条 甲方应保证办理电子支付业务账户的支付能力，并严格遵守支付结算业务的相关法律法规。"},
"l2834":{"C":"第五条 如因甲方指定账户已销户或账户状态不正常（挂失、冻结）、余额不足等原因，导致乙方无法履行协议的，乙方不承担任何责任。"},
"l2835":{"C":"第六条 甲方与除甲乙双方之外的任何第三方机构（包括第三方支付平台、甲方所购买商品或服务的销售方、商品配送方等）之间的交易纠纷与乙方无关。乙方不受理甲方对其他任何第三方的投诉。"},
"l2836":{"C":"第七条乙方可以自主根据业务发展需要增加、删除或变更合作的商户。"},
"l2837":{"C":"第八条 甲方通过在网上同意本协议并经过认证工具的认证后开通电子支付功能；甲方如需终止使用乙方提供的支付服务，可通过点击相关页面的取消功能撤销支付服务。"},
"l2838":{"C":"第九条 本协议作为甲乙双方已经签署的《中国银行股份有限公司网上银行个人客户服务协议》及其他既有协议和约定的补充部分而非替代文件，与其具有同样的法律效力。甲方在使用乙方提供的服务时应遵守电子银行章程、业务规则和已签署的所有相关协议，以及其他相关的业务规定。"},
"l2839":{"C":"第十条 甲方发现自身未按规定操作，或由于自身其他原因造成电子支付指令未执行、未适当执行、延迟执行的，应及时通过拨打服务热线或到营业网点通知乙方。乙方应积极调查并告知甲方调查结果。"},
"l0283":{"C":"执行方式"},
"l2840":{"C":"第十一条 因不可抗力或其他非乙方原因（设备故障、通讯线路故障及断电、停电等）造成的乙方没有正确执行甲方提交的电子支付指令或业务中断，乙方不承担任何责任。"},
"l2841":{"C":"第十二条 甲乙双方在履行本协议的过程中，如发生争议应协商解决，协商不成的，按照双方已经签署的《中国银行股份有限公司网上银行个人客户服务协议》中的约定方式解决。"},
"l2842":{"C":"第十三条 本协议的成立、生效、履行和解释，均适用中华人民共和国法律；法律无明文规定的，可适用通行的金融惯例。"},
"l2843":{"C":"第十四条 本协议自甲方在网上同意并经过认证工具的认证后开通电子支付功能之时起生效，自撤消本服务之时起终止。所有时点均以中国银行网上银行系统记录的时间为准。协议终止并不意味着终止前所发生的未完成交易指令的撤销，也不能消除因终止前的交易所带来的任何法律后果。"},
