"l29290":{"C":"甲方声明和保证："},
"l29291":{"C":"《中国银行股份有限公司个人“双向外汇宝、账户贵金属”买卖交易协议》（以下简称《交易协议》）是甲方在进行个人“双向外汇宝、账户贵金属”买卖交易前本着“自主决定、自担风险”的原则，与乙方签订的规范双方权利义务的协议。"},
"l29292":{"C":"交易保证金是甲方主动从签约账户转入交易专户、用于充当建立和支持“双向外汇宝、账户贵金属”买卖合约的担保资金。甲方以交易专户内全部资金质押为买卖提供担保，乙方有权就交易专户内资金优先受偿。交易专户内的资金不得挂失、不得提取现金、不得开具存款证明、不得为其他债务提供担保。"},
"l29293":{"C":"第九条 交易记录"},
"l29294":{"C":"甲方交易专户中的保证金余额计活期存款利息，具体参照活期存款计息规定。由于保证金账户涉及高风险业务，出于甲方资金安全考虑，在甲方未解约之前，保证金利息暂时不能提供甲方查询和使用。"},
"l29295":{"C":"开仓：也称建仓、开盘。指甲方买入或卖出规定的可交易的货币对或贵金属的操作。开仓时，银行系统自动按照当时的保证金交易价格计算开仓合约须占用的保证金，并比较该甲方的可用保证金是否充足，如果甲方可用保证金小于开仓须占用的保证金，则交易不成功。"},
"l29296":{"C":"(2)完整如实填写《中国银行股份有限公司“双向外汇宝、账户贵金属”业务申请表》。"},
"l29297":{"C":"时间：《交易协议》所提及的时间点均为北京时间，有其他特别约定的除外。"},
"l29298":{"C":"向乙方所在地人民法院提起诉讼解决。"},
