"l2940":{"C":"第二条 甲方申请使用乙方的电子支付功能必须首先成功申请成为乙方网上银行的客户，并已经申请了乙方指定的网上银行认证工具。甲方通过乙方网上支付所进行的一切经过认证工具认证后的交易，乙方均视为甲方亲自办理。甲方不得要求变更或撤销已经提交的电子支付指令。"},
