"l34939":{"C":"甲乙双方本着自愿的原则，为明确双方权利、义务，特拟定协议如下："},
"l3493":{"C":"请选择服务"},
"l34940":{"C":"甲方应按照网上银行/自助终端界面要求正确填写或确认有关客户信息、缴费账号、签约账号、接收和发送手机号码等内容，甲方应保证所填写的资料真实、准确、完整。"},
"l34941":{"C":"甲方在定制服务时输入的短信通知发送手机号码为甲方指定的唯一可用于向乙方主动发送查询短信的手机号码，接收手机号码为甲方指定的可用于接收乙方发出短信的手机号码。接收手机号码可为多个，每个账号（或卡号）+手机号码为一个收费单位。甲方应保证在定制服务时输入的短信通知手机号码为中国移动、中国联通或中国电信的合法手机号码（不含小灵通号码），并能够正常接收短信，"},
"l34942":{"C":"甲方有义务保证其动户短信不会透露给第三者，如因甲方原因造成账户信息泄露，甲方应自行承担因此造成的任何损失。甲方收到的短信动户通知内容与本人知悉的动户情形不符的，应于收到该短信动户通知时立即与乙方核实。"},
"l34943":{"C":"如甲方的短信通知接收或发送手机号码、缴费账户变更，甲方应及时至乙方营业网点或在支持业务的其他渠道进行变更或撤销签约；否则，甲方应自行承担因此造成的任何损失。"},
"l34944":{"C":"甲方在销户或销卡前，应先办理取消本协议项下短信服务。"},
"l34945":{"C":"本项业务为收费业务，收费标准请见《中国银行服务收费业务价格公告表》，乙方通过网上银行/自助终端向甲方展现收费标准、优惠模式及缴费周期。甲方在此授权乙方从指定的缴费账户上主动扣费，不再另行通知甲方。甲方应确保缴费之日其指定缴费账户内有足够余额，如因甲方缴费账户余额不足或账户状态不正常等导致乙方扣费不成功，乙方将在次月补扣，连续3次扣费不成功，乙方有权自动暂停或终止本服务。本服务暂停后，经甲方短信或书面确认继续使用本服务且补缴短信通知服务费后，乙方可为甲方继续开通并提供本服务。"},
"l34946":{"C":"1）本服务自开通次月起按照前述1.6款进行收费；（2）如约定有免费优惠期，免费优惠期自本服务开通之日起计算，免费优惠期届满后按照前述1.6款收费；（3）甲方缴纳短信通知服务费后，在服务期间甲方提出终止本协议项下短信服务，则已缴纳的短信通知服务费不再退还，请甲方慎重选择缴费周期。"},
"l34947":{"C":"乙方应对甲方提供的申请资料、账户信息和交易信息等资料保密，但法律法规、监管规定另有要求的除外。"},
