"l3680":{"C":"1. 您预留的“欢迎信息”是提高您对假网站的辨别能力的一种简单有效的方法。当您在此设置好“欢迎信息”后，在您每次登录时，该信息将显示在欢迎页面上，如该网站未能正确显示您预留的欢迎信息，说明该网站不是中行网站，请立即退出并及时与我行客服中心联系。  2. 您可以填写30个汉字或60个英文字符以内的欢迎信息。"},
