"l38051":{"C":"开通约定转存服务的个人一天/七天通知存款，在预约支取日取款，按照支取当日挂牌公告的一天/七天通知存款利率结息；在预约支取日前取款，按照支取当日挂牌公告的活期储蓄存款利率结息，如支取的通知存款已做过自动转存，则提前支取日结清的税前利息为：上次转存后的本息合计数（税后）×实际存期（即由上次自动转存日起算至提前支取日的前一天止）×活期储蓄存款日利率。"},
