"l38194":{"C":"<span class='strong'>甲方认/申购及赎回申请在申请日乙方规定的交易截止时点后不得撤销；甲方应在乙方规定期间后按乙方规定及时确认认/申购及赎回的有效性。</span>"},
"l38195":{"C":"具体详见《产品说明书》。"},
"l38196":{"C":"<span class='strong'>甲方在此认可乙方通过中国银行门户网站（www.boc.cn）方式进行信息披露，甲方应及时查看，以免因未及时获知信息而错过资金使用和再投资的机会。</span>"},
"l38197":{"C":"（二）因法律法规、监管规定、监管部门政策变化、自然灾害、意外事故、战争、系统故障、通讯故障等乙方不能控制或不可归责于乙方的因素，导致乙方无法或延后履行本协议及其他理财产品文件的，乙方不承担责任，但乙方应在条件允许的情况下采取必要的补救措施，以减少损失。"},
"l38198":{"C":"（三）非因乙方原因（包括但不限于本协议遗失或被盗、甲方资金账户及相关交易账户被有权机关冻结或扣划、甲方将本协议中所指卡、折等重要物品或信息交由乙方人员保管或向第三方披露等原因）造成的甲方损失，乙方不承担责任。"},
"l38199":{"C":"（四）本协议及理财产品文件均适用中华人民共和国法律。本协议项下的任何争议，双方应通过友好协商解决；若协商不成，依法向甲方具体办理理财产品交易的乙方分支机构所在地人民法院提起诉讼。在争议解决期间，若该争议不影响本协议及理财产品文件其他条款的履行，则该其他条款应继续履行。"},
"l0381":{"C":"预约日期"},
"l38200":{"C":"（一）甲方为个人投资者的，本协议经甲方签字，乙方盖章后生效；"},
"l38201":{"C":"甲方为机构投资者的，本协议经甲方法定代表人或授权签字人签字并加盖法人公章，乙方盖章后生效；"},
"l38202":{"C":"（二）除《产品说明书》约定的提前终止情形外，甲方有违约行为或甲方资金账户被有权机关冻结、扣划时，乙方有权提前终止本协议。"},
"l38203":{"C":"（三）除非甲乙双方签署新的协议替换本协议，本协议长期有效，乙方将在购买某理财产品的《产品说明书》或其它法律文件中定期与甲方确认本协议，甲方应予配合。"},
"l38204":{"C":"（四）乙方按照法律法规、监管规定和理财产品文件的约定调整投资范围、投资品种、投资比例、收费项目、收费条件、收费标准、收费方式等理财产品文件的内容及条款的，除双方另有约定外，调整后的内容及条款对调整生效前甲方已经成交的交易不发生效力；甲方不接受上述调整的，如理财产品允许甲方提前赎回，甲方有权按照理财产品文件的约定提前赎回。"},
"l38205":{"C":"（五）如甲乙双方在本协议生效前就理财产品已签署理财类总协议或仅就某理财产品单独签署理财协议（下称“已签协议”），本协议生效后，甲方向乙方新购买的任何理财产品，除双方另有约定外，均适用本协议，不适用已签协议。"},
"l38206":{"C":"（六）若乙方因业务需要须委托中国银行股份有限公司其他机构履行理财产品文件项下权利及义务，甲方对此表示认可；乙方授权的中国银行股份有限公司其他机构有权行使理财产品文件项下全部权利，有权就理财产品文件项下纠纷向法院提起诉讼或提交仲裁机构裁决。在不影响理财产品文件其他约定的情形下，理财产品文件对双方及各自依法产生的承继人和受让人均具有法律约束力。"},
"l38207":{"C":"（七）本协议一式两份，具有同等法律效力，甲乙双方各执一份。"},
