"l39303":{"C":"为方便客户及时了解大额资金变动情况，中国银行为客户提供大额交易提醒服务，此服务为免费服务，但仅针对单笔金额达到或超过起点金额的的出账/入账交易发送账户变动通知（提醒起点金额以当地中行设置为准）。为保护客户信息，签约此业务的账户暂不能同时开通普通短信通知及短信查询服务；且一个账户/借记卡只能签约唯一的手机号。"},
"l39304":{"C":"客户应按照网上银行/自助终端界面要求正确填写或确认有关客户信息、签约账号、手机号码等内容，客户应保证所填写的资料真实、准确、完整。"},
"l39305":{"C":"客户在定制服务时输入的手机号码为客户指定的可用于接收中国银行发出短信的手机号码。客户应保证在定制服务时输入的手机号码为中国移动、中国联通或中国电信的合法手机（不含小灵通号码），并能够正常接收短信，如因客户或客户所签约手机功能、状态、信号、服务区域限制等非中国银行原因而造成客户未能收到动户短信，则中国银行无需承担相关责任。客户到境外如不开通漫游服务将无法收到短信。"},
"l39306":{"C":"客户有义务保证其动户短信不会透露给第三者，如因客户原因造成账户信息泄露，客户应自行承担因此造成的任何损失。如收到的动户通知内容与本客户知悉的动户情形不符的，应于收到该短信时立即与中国银行核实。短信提醒的内容不作为入账及对账凭据。"},
"l39307":{"C":"如客户的接收手机号码变更，客户应及时至中国银行营业网点或在支持业务的其他渠道进行变更或撤销签约；否则，客户应自行承担因此造成的任何损失。致使第三人受到影响或提出异议，中国银行有权终止本服务。"},
