"l41079":{"C":"28、甲方应在到期还款日之前及时偿还欠款，甲方可以至乙方任一网点柜台、自助设备、网银等渠道办理还款业务。甲方如选择自动转账还款方式，甲方在此授权乙方于约定日期从甲方指定扣款账户按约定金额扣款，转入其信用卡账户以清偿欠款。甲方应提前1天保证扣款账户余额充足，并核对账单中显示扣款账号。如自动转账还款失败，甲方须及时通过其他渠道主动办理还款业务。"},
