"l41082":{"C":"4、如乙方从公安机关、司法机关、甲方本人、亲属、交易监测或其他渠道获悉甲方出现身份证件被盗用、家庭财务状况恶化、还款能力下降、预留联系方式失效、资信状况恶化、有非正常用卡行为等风险信息时，有权立即停止上调授信额度、超授信额度用卡服务授权、分期业务授权等操作，并可视情况采取提高交易监测力度、调减授信额度、止付、冻结或落实第二还款来源等风险管理措施。"},
