"l41084":{"C":"甲方授权并同意，乙方在以下业务范围内向中国人民银行个人信用信息基础数据库等相关部门、机构或个人了解或查询甲方的信息等情况，并保留相关资料：（1）审核个人信用卡申请的；（2）审核个人作为信用卡申请人的担保人的；（3）对甲方信用卡透支或个人担保进行评估管理的；（4）受理法人或其他组织的单位卡、公务卡申请或其作为担保人，需要查询其法定代表人及出资人信用状况的。甲方同时授权乙方可以将甲方的个人信用信息向中国人民银行个人信用信息基础数据库报送。甲方授权并同意，乙方有权根据相关法律法规、监管规定的要求向有权机关报送甲方的相关信息。如甲方资信出现恶化或违法、违规用卡等风险情况，乙方有权将有关风险信息向有权机构及相关信用卡风险信息组织报送。"},
