"l41092":{"C":"基于甲方完全知悉、理解并遵守《中国银行股份有限公司信用卡章程》、本合约，甲方自愿向乙方申请使用中国银行股份有限公司信用卡(以下称“信用卡”)。就信用卡的申领和使用等相关事宜，甲乙双方签订如下合约："},
"l41093":{"C":"1、甲方保证向乙方提供的所有申请资料真实、完整、准确、合法、有效，且无论申请成功与否，甲方同意乙方可以保留相关申请资料。申请材料须由甲方本人亲自签名。"},
