"l41095":{"C":"22、甲方使用信用卡所发生的各种收付款项由乙方记入甲方信用卡账户。该账户存款不足发生透支时，乙方对透支额适用上一条款关于免息和计收透支利息等相关规定。信用卡透支利息按月计收复利，日利率为万分之五（年化利率约为19.9%），如有变动按中国人民银行的有关规定执行；起息日以透支交易记账日为准。"},
