"l41113":{"C":"13、乙方在此提示甲方，如甲方选择无卡环境交易（如MOTO类交易），甲方应在符合法律、法规、监管规定、相关国家标准和行业惯例的安全技术和商户环境下在互联网、MOTO类商户（如互联网、邮购、电话购物等无需刷卡完成交易的非面对面刷卡交易商户）使用信用卡，并充分了解该类交易的交易对象、交易背景、交易环境及交易风险等情况，确保交易真实合法，否则甲方可能承担因此引起的风险及损失。持卡人在互联网、MOTO类商户等非面对面刷卡交易渠道使用信用卡的，基于持卡人卡号等卡片信息或卡片密码、电话银行密码、相关身份验证信息等电子数据而办理的各项交易所产生的信息记录之一或全部构成该项交易的有效凭据。"},
