"l41116":{"C":"26、对于信用卡发生的消费、转账、利息、费用等交易账项，乙方将于每月指定的日期（账单日）形成对账单并向甲方发送，但当月内没有任何交易且账户没有任何未偿还余额、向甲方提供其他方式记录以及另有约定的除外。如甲方自账单日起15天内未收到对账单，应主动向乙方查询。甲方不得以未收到对账单为理由拒绝偿还欠款。"},
