"l41120":{"C":"23、除另有约定之外，乙方对信用卡账户内的存款（含溢缴部分）不计付利息。对于明确约定计付利息的信用卡产品，乙方对甲方信用卡账户内的存款按照中国人民银行规定的同期同档次活期存款利率及计息办法计付利息。人民币存款按季结息，每季末月20日为结息日；外币存款按年结息，每年12月20日为结息日。存款按结息日挂牌公告的活期存款利率计息，遇利率调整不分段计息；销户结清时，按销户办妥前一天挂牌公告的活期存款利率进行结息处理。外币账户资金不得超过中国人民银行规定的小额存款上限。"},
"l41121":{"C":"25、一般情况下，信用卡的各项费用在卡片激活后收取，但在特殊情况下，甲方以书面、客户服务电话录音、电子签名、甲乙双方均认可的方式单独授权扣取的费用，以及换卡时已形成的债权债务关系除外。"},
"l41122":{"C":"5、甲方在获准申领信用卡后，信用卡主账户即具备信用消费、分期付款、在境内乙方营业柜台、ATM机或存取款一体机等自助设备上进行查询、取现、还款等交易的全部或部分功能。每种信用卡具体功能以甲方申请的该信用卡产品为准。甲方已完全知悉ATM机、电话银行等渠道的自助转账业务风险，在此申请并同意开通上述相关功能并遵守相关业务合同。开通自助转帐功能后，信用卡资金将在通过相关验证程序后实现自助渠道资金转帐划转，请充分关注以上风险，并妥善保管信用卡及其卡片信息、个人身份信息及有关密码等验证信息。"},
"l41123":{"C":"36、乙方根据甲方申请信用卡时指定的通讯地址、手机号码等联络信息为其提供服务，对账单、催收单以及相关法律文书、诉讼文件的送达地均以此为准。甲方联络信息如有变更，应及时致电乙方客户服务热线通知乙方办理资料变更手续，否则乙方按甲方指定的通讯地址、手机号码等联络信息送达的文件均为有效送达，由于甲方未及时通知乙方联络信息变更而产生的风险和损失由甲方自行承担。"},
