"l41128":{"C":"10、如甲方申请开通人民币单一结算功能，乙方将甲方外币交易款项、计收利息及相关费用按乙方入账当日乙方公布的外汇卖出牌价（如遇法定节假日则按前一工作日汇率）折算为人民币金额。甲方同意承担因此可能产生的汇兑风险、损失和相关机构收取的跨境交易货币兑换手续费。开通上述功能的信用卡不接受外币存入或转入交易（退货、退税交易除外）。"},
"l41129":{"C":"主卡和其附属卡共享信用额度，甲方（作为主卡持卡人）有义务督促其附属卡持卡人遵守《中国银行股份有限公司信用卡章程》及本合约的相关规定。甲方（作为主卡持卡人）和附属卡持卡人对附属卡项下的全部债务（包括但不限于透支本息、超限费、滞纳金、相关费用等全部债务，下同）向乙方承担连带清偿责任。"},
