"l41130":{"C":"甲方在到期还款日之前未能偿还当期对账单列明的最低还款额（最低还款额=信用额度内消费金额×10%+预借现金交易金额×100%+前期最低还款额未还部分×100%+超过信用额度消费金额×100%+所有费用和利息×100%），甲方除按照规定利率支付透支利息外，还应按最低还款额未还款部分的5%支付滞纳金（滞纳金=（最低还款额－您已还款金额）×5%）。"},
