"l41147":{"C":"7、对于甲方已持有乙方发行的信用卡（长城国际卡除外）的，本合约自 年 月 日生效，原乙方发行的除长城国际卡外的所有信用卡的领用合约同时废止。如甲方不同意接受本合约，有权随时选择办理信用卡销户手续，甲方未办理信用卡销户手续或继续接受甲方信用卡服务的，视为同意接受本合约，甲方在本合约生效后所持有或已申请的、乙方发行的除长城国际卡外的所有信用卡及其持卡人均受本合约约束。"},
