"l41150":{"C":"电子现金账户余额包括电子现金账户余额和补登余额。电子现金账户余额上限、每次充值交易金额上限均按照中国人民银行和乙方相关规定执行。甲方可在乙方营业柜台或通过自助设备查询电子现金账户余额。甲方可前往乙方营业柜台或使用乙方提供的自助设备，使用现金、乙方所发行的借记卡或信用卡为甲方的电子现金账户进行充值交易，转账充值需输入转出卡片的交易密码。"},
