"l41158":{"C":"乙方将依据甲方资信状况、用卡情况和外部风险环境的变化对甲方信用卡账户进行动态管理（包括授信额度动态调整、冻结等），并将提前通过电话或短信方式告知甲方。乙方可对超过6个月未发生交易的信用卡调减授信额度，并将提前3个工作日通过电话或短信方式明确告知甲方。"},
