"l41166":{"C":"30、甲方未能按时还款，乙方有权自行或委托第三方通过信函、短信、电子邮件、电话、上门、公告或司法途径等方式向甲方催收欠款，并有权同时选择采取如下措施：停止该卡及甲方名下其他乙方发行的信用卡的使用；行使担保物权；向担保人追索；从甲方在乙方任何机构开立的账户中扣收欠款，甲方在此授权乙方可主动扣划上述帐户内相应款项（未到期视为到期）。甲方应赔偿乙方因催收而产生的相关损失（包括但不限于律师费、公告费等）。"},
