"l41168":{"C":"请填写E-mail"},
"l41169":{"C":"15、信用卡遗失、被窃时，甲方应及时办理挂失手续，挂失可通过致电乙方客服热线办理。挂失自挂失手续办理完毕时生效。除另有约定外，甲方对挂失生效前发生的交易承担责任；甲方对挂失生效后发生的交易不承担责任，除非甲方对该交易存在欺诈、串通他人欺诈、不诚信行为或甲方拒绝配合乙方进行相关调查或提供相关证明的。"},
