"l41170":{"C":"7、如甲方使用双币信用卡，并在境内外贴有“银联”标识的商户刷卡消费或在贴有“银联”标识的ATM机上进行交易的，其交易款项、计收利息及相关费用以人民币结算。甲方在除中国银联股份有限公司之外的相关国际组织/机构联网的ATM机、前述国际组织/机构的会员进行交易的，以外币结算并记入其信用卡外币账户（但客户选择实时外币兑换业务等特殊服务的除外）。"},
