"l41172":{"C":"第二条 使用"},
"l41173":{"C":"感谢您申请中国银行信用卡，您本次的申请编号是{0}请牢记此编号，以便您后续查询申请进度。"},
"l41174":{"C":"16、信用卡卡片的有效期一般为五年，但不同的信用卡产品有效期不同，过期卡片自动失效。若甲方在信用卡有效期届满后不继续使用信用卡，应提前50天以书面方式或双方认可的其他方式通知乙方，否则视同甲方继续使用信用卡，乙方将为甲方提供更换新卡服务。更换新卡后，本合约继续有效。如因乙方与合作单位或组织终止合作等原因导致无法补换卡的，甲方同意乙方可发放其它信用卡产品作为补换。对甲方在信用卡有效期内未激活的信用卡账户，乙方不提供到期换卡服务。甲方因使用信用卡形成的债务不因卡片有效期届满、更换等原因而变更或消灭。"},
"l41175":{"C":"会员号/昵称"},
"l41176":{"C":"33、本合约未尽事宜依据《中国银行股份有限公司信用卡章程》、相关信用卡产品使用手册或使用指南及相关法律法规、监管规定、行业惯例、信用卡组织/机构的规定等办理。乙方有权根据法律法规和监管规定及业务发展实际对本合约及《中国银行股份有限公司信用卡章程》、使用手册或使用指南、收费项目、收费标准、利率、产品服务等进行修改、变化和调整，并将提前公告通知甲方，上述修改、变化和调整后的条款对甲乙双方均有约束力。若甲方有异议，有权选择办理信用卡销户手续，甲方未办理信用卡销户手续的，视为同意接受上述修改、变化和调整。双方同意，本合约所称通知均指乙方通过其营业网点、客服电话、官方网站（http://www.boc.cn）等对外发布公告。"},
