"l41180":{"C":"31、乙方收到甲方还款时，按照以下顺序对其信用卡账户的各项欠款进行冲还：（1）逾期1至90天（含）的，按照先应收利息或各项费用、后本金的顺序进行冲还；（2）逾期91天以上的，按照先本金、后应收利息或各项费用的顺序进行冲还。"},
"l41181":{"C":"12、信用卡只限甲方本人使用，不得以转借、出租等任何方式被其他个人或机构使用，否则乙方有权收回信用卡，由此造成的损失由甲方承担。甲方因出租、转借信用卡及其账户，或违反《中国银行股份有限公司信用卡章程》、本合约、或信用卡产品使用手册或使用指南等规定的视为甲方违约，由此产生的后果均由甲方负责，并承担因此给乙方或第三方造成的损失。"},
"l41182":{"C":"6、除非另有约定，本合约所指的“天”均为自然日。"},
