"l41191":{"C":"17、甲方不再使用信用卡的，需向乙方申请办理销户手续。甲方申请销户时应按乙方规定办理销户手续。甲方应承担信用卡正式销户前该卡项下的所有债务，并且所有未清偿款项在申请办理销户手续时视为全部到期，甲方应一次性清偿该等债务。甲方未全额清偿账户透支本息及相关费用的，乙方不予办理销户手续。"},
