"l42475":{"C":"2、甲方使用信用卡所发生的各种收付款项由乙方记入甲方信用卡账户。该账户存款不足发生透支时，乙方对透支额适用上一条款关于免息和计收透支利息的规定。信用卡透支利息按月计收复利，日利率为万分之五，如有变动按中国人民银行的有关规定执行；起息日以透支交易记账日为准。"},
"l42476":{"C":"中国银行股份有限公司信用卡领用合约"},
"l42477":{"C":"4、本合约适用中华人民共和国有关法律，甲乙双方在履行合约时发生的一切争议，由双方协商处理；协商不成，可由任何一方提交甲方具体办理信用卡申领手续的乙方分支机构所在地有管辖权的人民法院诉讼解决。"},
"l42478":{"C":"9、乙方在此提示甲方，如甲方选择无卡环境交易（如MOTO类交易），甲方应在符合法律、法规、监管规定、相关国家标准和行业惯例的安全技术和商户环境下在互联网、MOTO类商户（如互联网、邮购、电话购物等无需刷卡完成交易的非面对面刷卡交易商户）使用信用卡，并充分了解该类交易的交易对象、交易背景、交易环境及交易风险等情况，确保交易真实合法，否则甲方可能承担因此引起的风险及损失。持卡人在互联网、MOTO类商户等非面对面刷卡交易渠道使用信用卡的，基于持卡人卡号等卡片信息或卡片密码、电话银行密码、相关身份验证信息等电子数据而办理的各项交易所产生的信息记录之一或全部均属于该项交易的有效凭据。"},
"l42479":{"C":"3、除另有约定之外，乙方对信用卡账户内的存款（含溢缴部分）不计付利息。对于明确约定计付利息的信用卡产品，乙方对甲方信用卡账户内的存款按照中国人民银行规定的同期同档次活期存款利率及计息办法计付利息。人民币存款按季结息，每季末月20日为结息日；外币存款按年结息，每年12月20日为结息日。存款按结息日挂牌公告的活期存款利率计息，遇利率调整不分段计息；销户结清时，按销户办妥前一天挂牌公告的活期存款利率进行结息处理。外币账户资金不得超过中国人民银行规定的小额存款上限。"},
"l42480":{"C":"5、乙方根据甲方指定的通讯地址、手机号码等联络信息为其提供服务，对账单、催收单以及相关法律文书、诉讼文件的送达地均以此为准。甲方联络信息如有变更，应及时致电乙方客户服务热线通知乙方办理资料变更手续，否则乙方按甲方指定的通讯地址、手机号码等联络信息送达的文件均为有效送达，由于甲方未及时通知乙方联络信息变更而产生的一切风险和损失由甲方自行承担。"},
"l42481":{"C":"刷卡消费时验密方式"},
"l42482":{"C":"为了确保您的办卡安全，请您务必准确填写下列信息："},
"l42483":{"C":"12、信用卡卡片的有效期一般为五年，但不同的信用卡产品有效期不同，过期卡片自动失效。若甲方在信用卡有效期届满后不继续使用信用卡，应提前50天以书面方式或双方认可的其他方式通知乙方，否则乙方视同甲方继续使用信用卡，将为甲方更换新卡。更换新卡后，本合约继续有效。如因乙方与合作单位或组织终止合作等原因导致无法补换卡的，甲方同意乙方可发放其它信用卡产品作为补换。对甲方在信用卡有效期内未激活的信用卡账户，乙方不提供到期换卡服务。信用卡卡片有效期届满不影响合约的继续履行。甲方因使用信用卡形成的债务不因卡片有效期届满、更换等原因而变更或消灭。"},
"l42484":{"C":"甲方授权并同意，乙方可以将甲方的个人信用信息向金融信用信息基础数据库报送。甲方充分了解并清楚知道，如甲方发生本合约项下违约事件，乙方会将因此产生的甲方不良信息向金融信用信息基础数据库报送，并在甲方本人征信报告中予以体现。若发生上述不良信息报送情形，乙方可以电话、短信、电子邮件、对账单、催收单等方式通知甲方，甲方联系方式以其申请信用卡时指定的或按本合约变更的联络信息为准。"},
"l42485":{"C":"6、乙方收到甲方还款时，按照以下顺序对其信用卡账户的各项欠款进行冲还：（1）逾期1至90天（含）的，按照先应收利息或各项费用、后本金的顺序进行冲还；（2）逾期91天以上的，按照先本金、后应收利息或各项费用的顺序进行冲还。"},
"l42486":{"C":"凡使用密码进行的交易均视为甲方本人所为并由甲方承担交易后果；未使用密码进行的签单交易（包括商户、柜台等的交易）及所有境外交易，以记载有甲方签名的交易凭证为该项交易的有效凭据。"},
"l42487":{"C":"乙方的部分信用卡产品除支持信用卡主账户之外，还支持电子现金账户(电子现金账户指具有快速支付、接触和非接触消费功能的小额支付账户)。电子现金账户具备小额快速支付、查询、充值等交易的全部和部分功能，不具备透支、转账、取现功能（若无特殊说明，以下条款所描述的交易皆为信用卡主账户交易）。具体功能以甲方申请的该信用卡产品为准。"},
"l42488":{"C":"5、甲方在获准申领信用卡后，信用卡主账户即具备信用消费、分期付款、在境内乙方营业柜台、ATM机或存取款一体机等自助设备上进行查询、取现、还款等交易的全部或部分功能。每种信用卡具体功能以甲方申请的该信用卡产品为准。甲方已知悉ATM机、电话银行等渠道的自助转账业务风险，在此申请并同意开通上述相关功能并遵守相关业务合同。开通自助转账功能后，信用卡资金将在通过相关验证程序后实现自助渠道资金转账划转，请甲方充分关注以上风险，并妥善保管信用卡及其卡片信息、个人身份信息及有关密码等验证信息。"},
"l42489":{"C":"3、为保证甲方利益，甲方在获准申领并收到信用卡后，应立即在信用卡背面的签名栏内，按照甲方在申请表上留存的签名式样签名，并在使用信用卡时使用相同的签名，否则由此产生的全部损失由甲方自行承担。对于未签名的卡片，乙方有权拒绝为其提供服务并予以收回。"},
"l42492":{"C":"国家助学贷款借款学生在校期间的利息由财政全额补贴。网上银行提前还款功能默认为先还利息后还本金。在校学生如通过网上银行进行提前还款操作，本应由财政全额补贴的当期利息将由您本人支付。为充分确保您的权益，请前往助学贷款经办机构办理。"},
