"l4506":{"C":"市价即时交易是指以成交时刻的最新银行价格成交。限价即时交易是指客户先根据当前牌价指定一个限价牌价，确认成交时的银行价格若满足此限价牌价则成交，反之则不能成交。获利委托交易是指客户指定一个高于市场价格的卖出价格或者低于市场价格的买入价格，当银行牌价达到指定价格时，挂单成功。止损委托交易是指客户指定一个低于市场价格的卖出价格或者高于市场价格的买入价格，当银行牌价达到指定价格时，挂单成功。二选一委托交易是指由一笔获利挂单交易和一笔止损挂单交易同时挂单组成的一笔复合型挂单交易。两笔交易货币对相同且交易金额相同，但指定的成交价格不同，且价差须大于银行买卖价差。两笔交易必须同时入挂，成交时先达到指定价格的一笔成交，另一笔则自动失效。"},
