"l45810":{"C":"（一）主办账户：是“主办账户”业务的主要基础签约账户，一个主办账户项下可以最多签有19个（柜台、网银、自助设备三个渠道合计）共享账户。主办账户支持普通活期、活期一本通账户（以下统称：活期类账户），并且必须为凭密码支取的个人结算账户。"},
"l45811":{"C":"（三）甲方可在“主办账户签约关系”生效后，办理共享账户解约（只解除该账户与主办账户关联关系，不影响其它账户与主办账户的关联关系），若解约成功，两者在签约期间的资金归集（如有）或智能定存（如有）等签约关系也将同时被解除。"},
"l45812":{"C":"<strong>第十一条</strong>  甲方使用乙方服务所签署的相关协议、凭证等文件，均为本协议不可分割的一部分，具有同等法律效力。"},
"l45813":{"C":"（四）主办账户解约成功后，该“主办账户签约关系”同时解除。"},
"l45814":{"C":"<strong>第十二条  甲方涉嫌从事洗钱、欺诈、恐怖融资等违反法律法规、监管规定行为，违反本协议或其他与乙方的相关协议，或存在恶意攻击乙方电子银行系统等行为，或因甲方与其他第三方发生纠纷而致乙方被卷入诉讼或遭受损失的，或甲方账户涉嫌被洗钱、欺诈、恐怖融资等违法违规行为利用的，乙方有权中止或终止本协议，或中止或终止提供相关服务并保留追究甲方责任的权利，甲方应承担因此给乙方造成的损失，如发生法院等司法机关、政府有权机关因扣划甲方资金而致乙方资金被扣划的，乙方有权扣划甲方资金予以补偿乙方因此所受的资金损失。</strong>"},
"l45815":{"C":"（一）因挂失、开立存款证明、司法冻结等原因造成账户状态不正常或销户。"},
"l45816":{"C":"（二）非凭密码支取的账户。"},
"l45817":{"C":"<strong>双方同意，本协议所称“公告”均指在乙方营业网点或乙方网站【http://www.boc.cn】、电子银行渠道等进行公告。</strong>"},
"l45818":{"C":"（二） 共享账户：可与主办账户办理资金归集、智能定存多种服务签约。共享账户为活期类账户时，可与主办账户签约资金归集服务，进行资金调拨；共享账户为定期类账户时，可与主办账户签约智能定存服务。上述资金归集、智能定存的服务内容及办理要求，须依据双方另行签署的该项服务协议确定。"},
