"l45825":{"C":"<strong>第三条  关于主办账户的相关约定</strong>"},
"l45826":{"C":"<strong>第一条</strong> “主办账户”业务：是乙方为满足甲方对于在乙方开立的多个银行账户的资金管理以及在日常生活中的金融支付需求，为甲方提供的一站式金融服务。主要包含账户管理、资金归集、智能定存、综合查询等服务，甲方能享受的具体服务范围和内容须以本协议及具体的服务申请及协议约定为准。"},
"l45827":{"C":"主办账户签约“定期转活期”服务后，当该账户发生支取类交易时，若账户资金不足以对外支付，乙方系统自动对指定共享账户定期存款按照册号、序号倒排序方式查找10笔（包括：已结清的子账户）与主办账户币别相同的子账户，即，找到子账户金额（不包括利息）大于等于资金缺口、账户状态正常，且册号、序号最大的子账号，则对该子账户中的定期存款（包括利息）全部提前支取（下称“结清”）转入主办账户中，以满足该账户对外支付需要；若前述10笔子账户均不符合上述条件或子账户本身不支持“定期转活期”功能，则无法完成结清处理，造成“定期转活期”服务交易失败。"},
"l45828":{"C":"2、甲方对本协议项下“定期转活期”服务办理解约，或累计转账金额达到甲方设定的最高累计转账金额，且甲方未对该金额提出变更申请时。"},
"l45829":{"C":"<strong>第一条</strong>  “主办账户”业务“智能定存”服务，是指乙方根据与甲方约定的时间、频率、转账方式、留存/转存金额等条件，自动进行甲方指定活期账户与定期账户间转账的一种服务方式，包括“定期转活期”和“活期转定期”两种服务。本协议仅针对“定期转活期”服务做出约定。"},
"l45830":{"C":"上述定期子账户结清时只支持整笔结清，不支持部分提前支取；只支持单笔结清，不支持单笔金额不满足资金缺口时的多笔累加。"},
"l45831":{"C":"2、主办账户或指定共享账户发生转产品（如：改变账户性质等）。"},
"l45832":{"C":"<strong>第五条  属于下列情况之一的，不得签约“定期转活期”服务：</strong>  主办账户或共享账户为签约自助贷款业务的账户；主办账户或共享账户为冻结、销户或账户状态不正常。"},
