"l45842":{"C":"<strong>当主办账户的“当前累计转账金额”达到“最高累计转账金额”时，“定期转活期”服务将自动终止；若一笔“定期转活期”处理时，共享账户某一定期子账户的结清金额【本金+利息-利息税（如有）】+“当前累计转账金额”超过“最高累计转账金额”，则该笔“定期转活期”服务处理失败。</strong>"},
