"l45844":{"C":"1、“定期转活期”功能的有效期届满，双方在本协议项下权利义务履行完毕。"},
"l45845":{"C":"<strong>第三条</strong>“定期转活期”中甲方指定定期账户（即：资金转出账户）为甲方指定的签约上述“主办账户签约关系”中符合本协议约定条件的任一定期类共享账户（下称“指定共享账户”）；甲方指定活期账户（即：资金转入账户）指签约上述“主办账户签约关系”中的主办账户（下称“主办账户”）。"},
