"l46286":{"C":"资金转入现金宝相当于购买了货币基金，风险不同于活期存款。货币基金主要投资于银行大额存单、债券等安全性高、收益稳定的金融工具。理论上存在亏损可能，但从货币基金历年数据来看，风险较小，收益稳定。"},
