"l46292":{"C":"您转入现金宝的资金在下一个证券交易日由基金公司进行份额确认，对已确认的份额会开始计算收益，收益计入您的现金宝资金内，请在份额确认后的第二天6:00后查看收益。现金宝资金基金公司确认份额后，不区分节假日、证券交易日，只要不转出，每天都会有收益，复利计算。    当日15:00前转入的资金会在下一个证券交易日确认，15:00后转入的资金会顺延1个证券交易日确认。双休日及国家法定假期，基金公司不进行份额确认。周一至周五为证券交易日时的收益显示规则如下："},
