"l4715":{"C":"您最近一次成功过登录本站是2012年8月8日 16:12"},
"l4716":{"C":"第八条　 甲方须按乙方要求开立或指定与债券托管账户相对应的资金账户，用于办理债券买卖资金结转、还本付息等业务。债券托管账户未销户前，甲方不得撤销该资金账户。甲方卖出债券后从资金账户提取现金，须按中国人民银行有关规定等相关法律、法规执行。"},
"l47175":{"C":"甲乙双方已签署《中国银行股份有限公司个人智慧主办账户业务协议》，并据此完成甲方“主办账户”（下称“主办账户”）、“共享账户”的指定与“个人智慧主办账户签约关系” （下称“主办账户签约关系”）的办理。就甲方在上述签约关系下主办账户与指定共享账户之间的资金归集服务，经双方友好协商，达成以下协议："},
"l47176":{"C":"<strong>第五条  属于下列情况之一的，不得签约“定期转活期”服务：</strong>  主办账户或共享账户为签约自助贷款业务的账户；主办账户或指定共享账户为冻结、销户或账户状态不正常。"},
"l47177":{"C":"4、资金归集服务有效期：自开始日期（签约当日即生效）起，直至甲方指定的结束日期（次日失效），有效期届满时乙方系统自动停止预约转账处理。未设立有效期的，在甲方办理解约前，均视为在有效期内。"},
"l47178":{"C":"<strong>第十条</strong>签约“定期转活期”功能的账户，对达到转账条件系统自动确发的“定期转活期”交易不允许办理冲正。"},
"l47179":{"C":"<strong>第二条</strong>“活期转定期”服务是指乙方根据与甲方约定的时间、频率、留存/转账金额、定期存款产品种类、存期等条件，将一定金额从甲方指定的活期账户转入其指定的定期账户中，转存为定期存款。签约“活期转定期”服务的账户，均按现行普通个人存款账户计息方式执行。"},
"l4717":{"C":"第九条　 甲方通过乙方网上银行进行债券交易应首先先开通中国银行个人网上银行投资服务。甲方必须妥善保管本人的网上银行用户名、密码、身份认证工具等相关要素，并对通过以上要素完成的金融交易负责。甲方通过乙方网上银行所进行的一切经过身份认证工具认证后的交易，均视为甲方本人办理。"},
"l47180":{"C":"状态"},
"l47181":{"C":"所属主办账户"},
"l47182":{"C":"<strong>2、“固定转账金额”方式：</strong>指根据甲方与乙方事先约定的时间、频率等条件，乙方将甲方主办账户中指定金额自动转入甲方指定定期账户（下称“指定共享账户”），转存为定期存款。"},
"l47183":{"C":"由主办账户中转账"},
"l47184":{"C":"<strong>属于下列情况之一的，不得签约“活期转定期”服务：</strong>主办账户或指定共享账户为冻结、销户或账户状态不正常；主办账户或指定共享账户为已建立数据安全的账户；主办账户或指定共享账户为签约自助贷款业务的账户。"},
"l47185":{"C":"（一）最高累计转账金额：指乙方系统进行转账处理的最大累计转账交易金额，一旦达到此金额，后续将不再进行转账处理。"},
"l47186":{"C":"<strong>第十二条 </strong>甲方签约“活期转定期”服务后，在有效期内可办理变更的服务内容包括：开始日期（签约生效前）、结束日期、触发金额、留存金额、最高累计转账金额、转账金额是否凑整、转账金额、转账周期、转账频率。"},
"l47187":{"C":"<strong>第十一条 </strong>“活期转定期”服务是乙方根据甲方预先约定的转账条件，由乙方自动进行转账处理，<strong>转账时乙方不再另行通知甲方。</strong>"},
"l47188":{"C":"主办账户户名"},
"l47189":{"C":"6、“固定留存金额”方式下，签约实时转出和实时转入转账方式时，主办账户或指定共享账户为已建立数据安全的账户；"},
"l4718":{"C":"第十条　 甲方办理债券申购、买卖交易时，应认真审核买入和卖出所填写的信息，确认提交后的交易指令不可变更或撤销。"},
"l47190":{"C":"<strong>第五条 </strong甲方签约“活期转定期”服务时，指定共享账户可以为定期一本通<strong>（含整存整取、定活两便、通知存款）</strong>、教育储蓄(限“固定转账金额方式”)和零存整取<strong>（限“固定转账金额方式”）</strong>账户。"},
"l47191":{"C":"<strong>第八条  出现以下情形之一的，乙方将无法按约定条件进行“定期转活期”服务处理，不构成乙方违约：</strong>"},
"l47192":{"C":"共享账户签约详情"},
"l47193":{"C":"<strong>当指定共享账户的当前累计转账金额达到最高累计转账金额时，资金归集服务将自动终止；若一笔资金归集业务处理后指定共享账户的当前累计转账金额将超过最高累计转账金额时，则乙方系统将自动调减该笔转账金额，使得转账处理后指定共享账户的当前累计转账金额正好等于最高累计转账金额，在按调减后的金额进行转账处理后，资金归集服务自动终止。</strong>"},
"l47194":{"C":"<strong>乙方：中国银行股份有限公司</strong>"},
"l47195":{"C":"5、“固定留存金额”方式下，由于存款结息导致的资金转入，或指定共享账户为其他账户的转息账户，其他账户结清或者部提时产生利息转入该共享账户而发生的余额变动；"},
"l47196":{"C":"<strong>第四条</strong>“活期转定期”功能，根据转账条件不同分为两大类："},
"l47197":{"C":"<strong>第十二条</strong> 甲方在有效期内可办理变更的服务内容包括：开始日期（签约生效前）、结束日期、最高累计转账金额。"},
"l47198":{"C":"<strong>第二条</strong> 签约资金归集服务，主办账户与指定共享账户均应为普通活期或活期一本通账户，币别、钞汇属性应相同，账户所有人为同一客户，人民币业务支持个人储蓄账户或个人结算账户办理签约，外币业务仅可为个人外币储蓄账户之间办理签约。 主办账户与指定共享账户按现行普通个人存款账户计息方式执行。"},
