"l47201":{"C":"3、有效期：自开始日期（当日即生效）起，直至结束日期（次日失效），开始日期最早为签约日的次日，也可由甲方指定签约后的某一日开始执行。有效期届满乙方系统自动停止转账处理。未设立有效期的，在甲方办理解约前，均视为在有效期内。"},
