"l47203":{"C":"<strong>第三条</strong> 本协议项下甲方指定活期账户（即：资金转出账户）为签约上述“主办账户签约关系”中的主办账户，甲方指定定期账户（即：资金转入账户）为甲方指定的签约上述“主办账户签约关系”中符合本协议约定条件的任一定期类共享账户。"},
