"l4720":{"C":"第十一条 乙方根据市场变化调整公布债券买卖价格，投资人自担风险。"},
"l4721":{"C":"第十二条　 甲方应及时登录中央结算公司复核查询系统，对其复核查询系统的初始密码及时进行修改并妥善保管。在遗忘密码时，甲方应及时登录乙方网上银行，通过托管账户管理服务功能重置中央结算公司复核查询系统密码。"},
