"l4735":{"C":"第二十条　 本协议自甲方开通网上银行个人记账式债券服务之时起生效，自甲方注销债券托管账户或个人网上银行投资服务之时起终止。所有时点均以乙方网上银行系统记录的时间为准。在甲方违反本协议约定或其他乙方业务规定的情况下，乙方有权中止或终止本协议。本协议终止并不意味着终止前所发生的未完成交易指令的撤销，也不能消除因终止前的交易所带来的任何法律后果。"},
