"l48371":{"C":"中国银行股份有限公司跨行资金归集协议"},
"l48372":{"C":"甲乙双方本着自愿、平等、互利的原则，达成以下跨行资金归集协议，双方承诺共同遵守："},
"l48373":{"C":"一、 甲方自愿申请跨行资金归集服务，授权乙方以甲方名义向甲方指定的他行账户（被归集账户）发起转账交易指令，将其中的资金按照甲方设置的归集规则自动归集到甲方在乙方开立的账户（归集账户）。"},
"l48374":{"C":"二、 甲方知晓并同意："},
"l48375":{"C":"（1）跨行资金归集服务通过人民银行网上支付跨行清算系统处理，以被归集账户与被归集账户所属行已签署授权甲方查询的协议、授权甲方支付的协议为前提（以下简称授权查询协议、授权支付协议）。甲方应确保上述协议的真实性和有效性，如上述协议失效或终止，则甲方将无法使用跨行资金归集服务。"},
"l48376":{"C":"（2）甲方设置的跨行资金归集规则中单笔、日累计、月累计额度不得超过授权支付协议中设置的相应限额，否则将会导致跨行资金归集失败。"},
"l48377":{"C":"（3）如甲方设置的跨行资金归集规则中归集金额超过5万，乙方将分拆成多笔归集交易执行。"},
"l48378":{"C":"三、 甲方应确保申请跨行资金归集服务时所提供信息的真实、有效、完整。对于甲方未提供真实、准确、完整的信息或信息发生任何变更而没有及时通知乙方而造成的风险和损失由甲方承担。"},
"l48379":{"C":"四、 甲方应妥善保管网上银行用户名以及登录密码、手机交易码、动态口令牌、数字安全证书等身份认证工具，谨防各种形式的诈骗。甲方通过网上银行进行的一切经过身份认证工具认证后的交易，均视为甲方亲自办理。"},
"l4837":{"C":"密码+签名"},
"l48380":{"C":"五、 甲方有权对本协议的跨行资金归集规则进行设置和修改，并通过身份认证工具认证后生效。"},
"l48381":{"C":"六、 甲方有权解除本协议。甲方发起解除协议指令，经乙方确认后本协议解除。"},
"l48382":{"C":"七、 乙方未按照本协议约定进行归集并造成甲方损失的，乙方应承担相应责任。但因以下原因造成跨行资金归集操作未能执行或执行失败的，不属乙方责任："},
"l48383":{"C":"（1） 被归集账户资金余额不足；"},
"l48384":{"C":"（2） 归集账户或被归集账户状态不正常，如账户挂失、冻结、止付等；"},
"l48385":{"C":"（3） 有权机关对归集账户或被归集账户执行冻结等措施；"},
"l48386":{"C":"（4） 授权查询协议、授权支付协议失效或终止；"},
"l48387":{"C":"（5） 不可抗力或其他不可归因于乙方的原因。"},
"l48388":{"C":"八、 甲方在使用乙方提供的服务时应遵守《中国银行股份有限公司电子银行章程》、《中国银行股份有限公司网上银行个人服务业务规则》和已签订的所有相关协议及约定。甲方应严格遵守国家的相关法律法规，不得利用跨行资金归集服务或归集账户、被归集账户从事任何欺诈、洗钱、恐怖融资等违反法律、法规、监管规定的行为。如因甲方违反上述约定给乙方造成损失的，甲方应予赔偿。如甲方违反本协议，乙方有权中止或终止提供跨行资金归集服务。"},
"l48389":{"C":"九、 本协议如与国家新颁布的法律、法规、条例等相抵触，以国家新颁布的法律、法规、条例为准。如因相关法律、法规、监管规定等变化导致本协议无法履行的，任何一方均有权解除本协议。"},
"l4838":{"C":"付款"},
"l48390":{"C":"十、 乙方系统升级、业务变化或收费变更，或根据业务发展需要修改本协议，乙方将提前进行公告。若甲方有异议，有权选择注销跨行资金归集服务，若甲方未注销本服务或继续接受本服务的，视为甲方同意按变更或修改后的内容执行。    本协议所称“公告”是指在中国银行营业网点、门户网站（www.boc.cn）、电子银行渠道等进行的公告。"},
"l48391":{"C":"十一、 本协议自甲方申请开通跨行资金归集服务的次日生效。如甲方在协议有效期内注销服务或撤销归集帐户，则本协议自动终止。所有时点均以乙方网上银行系统记录的时间为准。本协议终止并不意味着终止前所发生的未完成交易指令的撤销，也不能消除因终止前的交易所带来的任何法律后果。"},
