"l48583":{"C":"根据甲方选择的套餐类型，乙方向甲方提供不同期限不同标准的个人境内人民币业务费用优惠，甲方按约定提前一次性向乙方支付优惠后的费用之后，在相应套餐类型规定的有效期内和套餐交易笔数内，甲方指定账户（包括主签约账户和共享账户）办理符合套餐条件的汇款交易不再收取任何其他费用。"},
