"l48623":{"C":"十、<strong> 乙方系统升级、业务变化或收费变更，或根据业务发展需要修改本协议，乙方将提前进行公告。若甲方有异议，有权选择注销跨行资金归集服务，若甲方未注销本服务或继续接受本服务的，视为甲方同意按变更或修改后的内容执行。    本协议所称“公告”是指在中国银行营业网点、门户网站（www.boc.cn）、电子银行渠道等进行的公告。 </strong>"},
"l48624":{"C":"（1）跨行资金归集服务通过中国人民银行网上支付跨行清算系统处理，以被归集账户已在其开户银行（以下简称“开户银行”）有效签署了账户信息查询协议和授权支付协议为前提。本协议所称账户信息查询协议，指被归集账户所有人与开户银行签订的协议，协议约定开户银行在收到指定机构（本协议项下指乙方）发来的账户信息查询指令时，根据协议内容对账户信息查询业务有关要素核验通过后即可按该查询指令提供被归集账户的余额或交易明细信息。本协议所称授权支付协议，指被归集账户所有人与开户银行签订的协议，协议约定开户银行在收到指定机构（本协议项下指乙方）发来的支付指令时，根据协议内容对支付业务有关要素核验通过后即可按该支付指令从被归集账户进行付款。"},
"l48625":{"C":"<strong>（3） 有权机关对归集账户或被归集账户执行冻结等措施；</strong>"},
"l48626":{"C":"三、 甲方应确保申请跨行资金归集服务时所提供信息的真实、有效、完整。<strong>对于因甲方未提供真实、准确、完整的信息或信息发生任何变更而没有及时通知乙方而造成的风险和损失由甲方承担。</strong>"},
"l48627":{"C":"<strong>（4） 授权查询协议、授权支付协议失效或终止或未被有效执行；</strong>"},
"l48628":{"C":"四、 甲方应妥善保管网上银行用户名以及登录密码、手机交易码、动态口令牌、数字安全证书等身份认证工具，谨防各种形式的诈骗。<strong>甲方通过网上银行进行的一切经过身份认证工具认证后的交易，均视为甲方亲自办理。</strong>"},
"l48629":{"C":"八、 甲方在使用乙方提供的服务时应遵守《中国银行股份有限公司电子银行章程》、《中国银行股份有限公司网上银行个人服务业务规则》和已签订的所有相关协议及约定。甲方应严格遵守国家的相关法律法规，不得利用跨行资金归集服务或归集账户、被归集账户从事任何欺诈、洗钱、恐怖融资等违反法律、法规、监管规定的行为。<strong>如因甲方违反上述约定给乙方造成损失的，甲方应予赔偿。如甲方违反本协议，乙方有权中止或终止提供跨行资金归集服务。</strong>"},
