"l48700":{"C":"（五）乙方常规报价时间：北京时间周一上午7：00至周六凌晨6：00（纽约夏令时段为5：00，国际公共假日除外）。在报价正常及系统正常的情况下甲方可以正常进行交易，但:"},
"l48701":{"C":"（一）甲方有权了解乙方个人实盘账户贵金属业务的报价、交易时间、交易起点金额等信息。"},
"l48702":{"C":"（二）甲方应保证投资资金的来源合法，投资行为符合法律、法规及相关监管部门的规定。"},
