"l51240":{"C":"汇款套餐是我行提供的一种跨省转账或跨行转账相关费用打包优惠的服务。您可以通过柜台、网上银行、手机银行、自助终端、批量签约等方式，办理人民币汇款套餐的签约、解约、查询、变更等业务。"},
"l51241":{"C":"接受汇款套餐协议后，可以自助签约人民币汇款笔数套餐（跨省或跨行转账服务费优惠包）。"},
"l51243":{"C":"套餐属性包含付款方套餐、收款方套餐、双向套餐，付款方套餐支持维护多个共享账号使用同一个套餐，收款方套餐和双向套餐支持收款付费起点金额。签约后一次性从主签约账户中收取套餐手续费。在套餐笔数内，共享账户进行转账不再另外收取费用，收款时收款金额不小于收款付费起点金额时才会使用套餐笔数。"},
"l51244":{"C":"付款方汇款套餐：当主签约账户（或共享账户）为交易的转出账户时，适用付款方汇款套餐业务。业务种类限于中行内异地人民币转账汇款（汇出）、中行内异地柜台人民币取款，及跨行人民币汇款。"},
"l5124":{"C":"补缴税款"},
"l51251":{"C":"收款方汇款套餐：当主签约账户为交易的转入账户时，适用收款方汇款套餐业务。业务种类限于中行内异地人民币转账汇款（汇入）、中行内异地人民币存款，但若为中行内贷记卡账户（包括准贷记卡账户）发起的转账汇入不扣减套餐交易笔数。该类套餐不支持共享账户。"},
"l51252":{"C":"双向汇款套餐：当主签约账户为交易的转出\/转入账户时，适用双向汇款套餐业务。业务种类涵盖付款方汇款套餐及收款方汇款套餐内容。该类套餐不支持共享账户。"},
"l51254":{"C":"套餐修改只能修改汇款套餐信息：手机号和删除共享账户。"},
"l51257":{"C":"不能修改续约套餐类型和套餐属性。如果需要修改，可以先进行解约，然后重新签约。"},
