"l51881":{"C":"第八条  双方在履行本协议过程中，如发生争议，应协商解决。协商解决不成的，任何一方均可向甲方经办机构所在地人民法院提起诉讼。"},
"l51882":{"C":"（四）到期利息转存约定：定期产品本期到期时，本期利息根据本存期的“付息方式”设置进行处理，当下一存期再到期时，甲方将该账户下一存期到期时结出的利息转入乙方指定的活期类账户中。 以上四种服务，定期产品转存后，续存存期的起点为续存日，续存后的利率按甲方续存日对外公布的相应档次的存款利率为准。"},
"l51883":{"C":"为保证乙方在甲方开办个人定期存款约定转存服务的合法权利，规范业务管理，经甲乙双方友好协商，达成以下协议："},
"l51884":{"C":"转存账户"},
"l51885":{"C":"定期约定转存成功"},
"l51886":{"C":"（一）转产品约定：即定期产品到期时，甲方根据乙方签约时指定新存期自动转存为新的定期产品。下一期存期到期后仍按该约定存期自动转存，转存次数不限。"},
"l51887":{"C":"约定方式"},
"l51888":{"C":"约定"},
"l51889":{"C":"第四条  “定期约定转存服务”中涉及的乙方约定定期产品账户和指定的本金（利息）转出/转入账户须均归属在乙方本人名下，并且货币类型、钞汇属性必须相同。若由于上述账户中一个或多个因余额不足、不满足转存后新产品的最低起存金额（个人人民币整存整取存款的起存金额为50元，个人外币整存整取存款的起存金额为人民币100元的等值外币）、不足额缴纳手续费、有权机关依法对账户进行冻结或扣划，以及由于账户销户或其它原因导致账户状态不正常，或因不可抗力事件等非甲方因素造成甲方无法按约定条件履行转存处理的，对由此造成的相关风险及损失由乙方承担，甲方不承担任何责任。"},
"l5188":{"C":"账户贵金属交易账户"},
"l51890":{"C":"第七条  甲方具有对系统进行升级、改造的权利。因甲方对甲方系统进行升级、改造而引起的服务取消、暂停或者乙方账号、服务内容、项目、方式等变化，或根据业务发展需要增加或改进“定期约定转存服务”的功能和服务方式，以及对服务收取合理的费用，或修改本协议等相关法律文件，甲方将采取适当方式提前公告，不再逐一通知乙方，乙方不接受上述调整、修改的，有权在公告规定的合理时间内撤销本协议项下服务，若乙方在公告的业务变更或协议修改生效日期后仍继续使用相关服务，即视为乙方接纳该变更或修订。"},
