"l51897":{"C":"甲方：中国银行股份有限公司"},
"l51898":{"C":"（五）若乙方同时选择了“加本转存约定”/“减本转存约定”、“到期利息转存约定”和“转产品约定”三项功能，甲方自动按约定的新存期转存，本金及利息处理按本条第（四）款执行。若 “转产品约定”交易失败，则甲方自动按原存期进行转存，本金及利息处理按本条第（四）款执行。"},
"l51899":{"C":"第五条  “定期约定转存服务”是甲方根据乙方预先约定的转存条件，由甲方自动进行转存交易处理，转存时甲方不再另行通知乙方。"},
