"l51902":{"C":"乙方：{0}"},
"l51903":{"C":"第九条  乙方所填具的书面申请资料及使用甲方服务所签署的相关协议、凭证等文件，均为本协议不可分割的一部分，具有同等法律效力。"},
"l51904":{"C":"第十一条  本协议甲乙双方各持一份，具有同等法律效力。"},
"l51905":{"C":"（四）若乙方指定的定期产品账户同时约定“加本转存约定”/“减本转存约定”和“到期利息转存约定”两项功能，则该定期产品账户转存后的新存期的存款本金为：上述加本/减本处理后的账户余额，并以此计算新存期的利息。若“加本转存约定”/“减本转存约定”交易失败，则按本条第（二）款约定计算本金。新存期再到期时，按乙方“到期利息转存约定”进行到期利息处理，经利息处理后的定期产品账户余额为下一存期的存款本金。若“到期利息转存约定”交易失败，则按本条第（三）款约定进行利息处理及存款本金计算。"},
"l51906":{"C":"第六条  乙方申请查询、变更或撤销“定期约定转存服务”中相关事项，应由乙方本人持有效身份证件和存款凭证到甲方联网网点办理，如乙方委托他人代办，还须同时出具代办人有效身份证件。"},
"l51907":{"C":"约定存期"},
"l51908":{"C":"第一条  个人定期存款到期约定转存服务（以下简称“定期约定转存服务”）是指乙方与甲方事先约定，在乙方指定的已选择自动转存的定期一本通下整存整取产品（以下简称：“定期产品”）在本存期到期后，甲方根据约定条件，自动为乙方办理转存业务的一种服务方式。此项服务包括以下功能："},
"l51909":{"C":"您尚未开立定期账户，如需开立，请点击<a class=\"ml5\">这里</a>。"},
"l5190":{"C":"申请渠道"},
"l51910":{"C":"利息转存方式"},
"l51911":{"C":"（六）“加本转存约定”、“减本转存约定”按约定条件执行期满后即自动终止，不作循环加本/减本处理。“转产品约定”和“到期利息转存约定”按约定的新存期或新的利息方式进行循环处理。"},
"l51912":{"C":"（三）若“到期利息转存约定”交易处理时由于利息转入账户状态不正常等原因导致利息转入失败，则甲方将对原定期产品账户的利息扣除利息税后入本金，按约定存期转存。"},
"l51913":{"C":"拟减少金额"},
"l51914":{"C":"定期约定转存"},
"l51915":{"C":"（三）减本转存约定：即定期产品到期时，甲方将到期存款扣减约定的本金金额后转入乙方指定的活期类账户中，并将剩余存款续存。续存后产品仍为整存整取定期产品，如乙方未同时选择转产品服务，则续存存期与原存期一致。"},
"l51916":{"C":"第十条  本协议自乙方在《中国银行股份有限公司个人定期存款到期约定转存服务申请表》上签字、甲方经办机构在该申请表上加盖业务专用章之日起生效，至发生下列任一情形时终止："},
"l51917":{"C":"第十二条 甲乙双方已就本协议条款进行了充分的沟通，甲方已向乙方就本协议内容进行了全面、准确的解释和说明，乙方完全了解本协议内容并自愿遵照执行上述约定。"},
"l51918":{"C":"（二）若“加本转存约定”或“减本转存约定”交易失败，则甲方将按定期产品账户的当前账户余额作为本金，按约定存期自动转存。"},
"l51919":{"C":"（一）若“转产品约定”交易失败，则甲方将按定期产品原存期类型自动转存。下一期存期到期后仍按该存期产品类型自动转存，转存次数不限。"},
"l51920":{"C":"（一）双方就本协议项下的定期约定转存服务的权利义务按约定履行完毕；"},
"l51921":{"C":"（二）乙方申请撤销此项服务。"},
"l51922":{"C":"第三条  “定期约定转存服务”中转出账户和转入账户中若至少有一方为异地账户，办理异地账户转帐时，甲方将按挂牌公告的收费标准收取通存通兑手续费，甲方有权从乙方指定的本金（利息）转出/转入的活期类账户中自动扣收。"},
"l51923":{"C":"约定方式"},
"l51924":{"C":"第二条  乙方办理“定期约定转存服务”签约时，可以选择第一条中的其中一项功能，也可以同时选择多项功能，当乙方同时选择多项功能时（“加本转存约定”、“减本转存约定”为互斥功能，不能同时选择），各项功能单独执行，互不影响，如："},
"l51925":{"C":"拟减少金额"},
"l51926":{"C":"该设定将根据本次设置的约定方式在存期到期后自动执行新的转存"},
"l51927":{"C":"该设定仅在本次到期时执行一次转存"},
"l51928":{"C":"定期约定转存"},
"l51929":{"C":"约定存期"},
"l51930":{"C":"（二）加本转存约定：即定期产品到期时，甲方从乙方约定的活期类账户（包括普通活期或活期一本通账户，下同）中转出约定金额加到定期产品的账户中，新转入的金额与该账户原有金额一起作为新的本金进行续存。续存后的产品仍为整存整取定期产品。如乙方未同时选择转产品服务，则续存存期与原存期一致。"},
