"l52039":{"C":"第七条  账户在签约智能通产品期间，如遇法规政策、经济、以及不可抗力因素的影响或监管机构要求，甲方经提前公告可终止本产品。本产品终止前的利息仍按上述约定计息，本产品终止后的利息按活期存款计息。"},
"l5203":{"C":""},
"l52040":{"C":"（三）不能再办理存贷理财业务（如果在签约前已办理存贷理财业务，则不能签约智能通产品，须先取消该业务）。"},
