"l5346":{"C":"密码汇款是中国银行为您提供的一种新的汇款方式。您可通过网上银行、手机银行渠道发起汇款，预留收款人的手机号码和取款密码；汇款提交成功后，请将系统自动生成的汇款编号和预留密码告知收款人。收款人凭汇款编号、预留密码以及汇款时预留的手机号码收到的短信密码，即可办理取款。如收款人尚未取现或转账解付，您可以取消该笔密码汇款。"},
"l5347":{"C":"密码汇款仅限中国银行境内人民币汇款业务，汇款限额可通过“交易限额设置”功能在银行限额内自行设定。"},
"l5348":{"C":"您发起的密码汇款时可设置“是否允许在ATM支取现金”，若为“否”，则收款人只能在中国银行营业网点柜台办理现金收款或转账解付，转账解付时须为收款人同名账户；若为“是”，则收款人可在柜台或ATM取款，但汇款金额须为100元的整数倍，且小于ATM机单笔取款金额。ATM机取款时请认准“中国银行”标识。"},
"l5349":{"C":"当您通过网上银行或手机银行办理密码汇款业务时，将按照中行内跨省人民币转账标准预收相关费用，若收款人在同省营业网点或ATM机上办理取款时，银行将把预收费用退还至汇款人汇出账户，在此期间预收费用无利息。若ATM取现时出现系统故障，汇款款项将退回至汇款人的汇出账户。"},
"l53507":{"C":"未经贷款人书面同意，借款人不得改变借款用途。借款人不得将贷款用于无指定用途的个人支出，不得用于任何法律法规、监管规定、国家政策禁止银行贷款投入的项目、用途，如股票、证券投资、房地产开发投资等。"},
