"l5408":{"C":"申请加入"},
"l54090":{"C":"（五）本行将对基金投资人的风险承受能力进行调查和评价，并根据基金投资人的风险承受能力推荐相应的基金品种，但本行所做的推荐仅供投资人参考，投资人应根据自身风险承受能力选择基金产品并自行承担投资基金的风险。"},
"l54091":{"C":"股票"},
"l54092":{"C":"（一）证券投资基金是一种长期投资工具，其主要功能是分散投资，降低投资单一证券所带来的个别风险。基金不同于银行储蓄和债券等能够提供固定收益预期的金融工具，投资人购买基金，既可能按其持有份额分享基金投资所产生的收益，也可能承担基金投资所带来的损失。"},
"l54093":{"C":"投资于众多有价证券，能有效分散风险，风险相对适中，收益相对稳健"},
"l54094":{"C":"（三）基金投资人应当充分了解基金定期定额投资和零存整取等储蓄方式的区别。定期定额投资是引导投资人进行长期投资、平均投资成本的一种简单易行的投资方式，但并不能规避基金投资所固有的风险，不能保证投资人获得收益，也不是替代储蓄的等效理财方式。"},
"l54095":{"C":"表现为银行的负债，是一种信用凭证，银行对存款者负有法定的保本付息责任"},
"l54096":{"C":"尊敬的基金投资人："},
"l54097":{"C":"（八）基金合同约定的其它权利。"},
