"l54140":{"C":"（3）交易型开放式指数基金(ETF)与上市开放式基金(LOF)。交易型开放式指数基金，通常又被称为交易所交易基金(Exchange Traded Funds，简称“ETF”)，是一种在交易所上市交易的、基金份额可变的一种开放式基金。上市开放式基金(Listed Open-ended Funds，简称“LOF”)是一种既可以在场外市场进行基金份额申购赎回，又可以在交易所（场内市场）进行基金份额交易、申购或赎回的开放式基金。"},
"l54141":{"C":"根据《证券投资基金法》第70条的规定，基金份额持有人享有下列权利："},
"l54142":{"C":"基金"},
"l54143":{"C":"利息收入、股利收入、资本利得"},
"l54144":{"C":"（一）对基金投资人的风险承受能力进行调查和评价。"},
"l54145":{"C":"（一）分享基金财产收益；"},
"l54146":{"C":"（四）基金投资咨询服务。"},
"l54147":{"C":"债券发行机构、证券公司及银行等代销机构"},
"l54148":{"C":"（二）基金在投资运作过程中可能面临各种风险，既包括市场风险，也包括基金自身的管理风险、技术风险和合规风险等。巨额赎回风险是开放式基金所特有的一种风险，即当单个交易日基金的净赎回申请超过基金总份额的百分之十时，投资人将可能无法及时赎回持有的全部基金份额。"},
"l54149":{"C":"直接投资工具，主要投向实业领域"},
"l5414":{"C":"请您选择要使用动态口令作为3D认证工具的信用卡："},
"l54150":{"C":"本行为投资者办理基金业务的流程一般为：开卡签约、基金账户开户、认（申）购、设置分红方式、赎回、销户等。"},
"l54151":{"C":"投资收益与风险大小不同"},
"l54152":{"C":"（二）基金销售业务，包括基金（资金）账户开户、基金申（认）购、基金赎回、基金转换、定期定额、修改基金分红方式等。本行根据每支基金的发行公告及基金管理公司发布的其它相关公告收取相应的申（认）购、赎回和转换费"},
"l54153":{"C":"（2）保本基金。是指通过采用投资组合保险技术，保证投资者的投资目标是在锁定下跌风险的同时力争有机会获得潜在的高回报。"},
"l54154":{"C":"（四）基金评级"},
"l54155":{"C":"一般包括两大类：一类是在基金销售过程中发生的由基金投资人自己承担的费用，主要包括认购费、申购费、赎回费和基金转换费。这些费用一般直接在投资人认购、申购、赎回或转换时收取。其中申购费可在投资人购买基金时收取，即前端申购费；也可在投资人卖出基金时收取，即后端申购费，其费率一般按持有期限递减。另一类是在基金管理过程中发生的费用，主要包括基金管理费、基金托管费、信息披露费等，这些费用由基金承担。对于不收取申购、赎回费的货币市场基金和部分债券基金，还可按不高于2.5‰的比例从基金资产中计提一定的销售服务费。"},
"l54156":{"C":"基金评级是依据一定标准对基金产品进行分析从而做出优劣评价。投资人在投资基金时，可以适当参考基金评级结果，但切不可把基金评级作为选择基金的唯一依据。此外，基金评级是对基金管理人过往的业绩表现做出评价，并不代表基金未来长期业绩的表现。"},
"l54157":{"C":"证券投资基金（简称基金）是指通过发售基金份额，将众多投资者的资金集中起来，形成独立财产，由基金托管人托管，基金管理人管理，以投资组合的方法进行证券投资的一种利益共享、风险共担的集合投资方式。"},
"l54158":{"C":"信托关系，是一种受益凭证，投资者购买基金份额后成为基金受益人，基金管理人只是替投资者管理资金，并不承担投资损失风险"},
"l54159":{"C":"银行、信用社、邮政储蓄银行"},
"l5415":{"C":"您已成功开通个人全球账户管理服务。"},
"l54160":{"C":"（七）对基金管理人、基金托管人、基金份额发售机构损害其合法权益的行为依法提起诉讼；"},
"l54161":{"C":"（4）QDII基金。是一种以境外证券市场为主要投资区域的证券投资基金，投资者可以用人民币或美元等外汇进行认购和申购，在承担境外市场相应投资风险的同时获取相应的投资收益。QDII基金与普通证券投资基金的最大区别在于投资范围不同。"},
