"l54950":{"C":"（六）每日交易闭市结算后，如乙方的交易保证金比例低于甲方要求的、按乙方相应持仓品种的结算价和数量计算的保证金比例，即乙方的风险度大于100%，且在下一个交易日开市后乙方的风险度仍大于100%，其风险等级上升为红色强平级别。乙方必须在上午交易时段9:00之前追加足额保证金或者自行平仓，直至风险度大于等于0且小于100%。否则，乙方风险等级在仍处于红色强平级别的情况下，甲方有权对乙方的持仓执行部分或全部强行平仓处理，乙方应承担由此产生的后果。"},
"l54951":{"C":"（九）如前一交易日出现涨（跌）停板，当乙方的风险等级达到红色强平级别时，甲方有权在当前交易日开市后交易时段内的任意时间对乙方的持仓执行部分或全部强行平仓处理。乙方应承担由上述情况产生的后果及损失。"},
"l54952":{"C":"甲方对乙方通知义务的履行以甲方向移动通讯运营商发送信息时即视为送达。乙方因包括但不限于以下原因，而未收到手机短信所造成一切损失将由乙方承担，并不能作为未补足保证金造成强平或损失等情况不知情的抗辩理由："},
