"l55074":{"C":"部分产品提供“组合购买”服务功能，可在不占用现有资金的情况下，使用现已持有的理财产品等量份额，组合购买新的理财产品。在新的理财产品起息前，您仍能获得当前持有理财产品存续期的收益。"},
