"l55076":{"C":"保障卡专属理财产品仅针对持有中国银行社保金融IC卡、常青树养老卡、居民健康卡、长城健康卡、军人保障卡辅卡等保障卡客户销售。请您在购买前先将保障卡设定为理财交易账户。"},
"l55077":{"C":"周期性产品续约协议是由一系列同结构、有固定期限的单期产品组成，各期产品的收益率会因市场原因具有一定的差异性。该业务采取一次签约、每期自动扣划资金方式。您可以通过输入购买期数，使得本期产品到期后自动续约购买下一期产品，直至达到您设定的购买期数或至银行停止发售此系列产品。"},
