"l55083":{"C":"组合购买方式指您持有已起息、允许被组合的产品A，用来购买其他未起息的理财产品B，B产品起息前您仍可获得A产品的收益。例如：您已持有已起息的开放理财产品A，想购买正在销售的产品B，可以使用产品A的份额“组合购买”理财产品B。被组合产品A的将于B产品起息日赎回，并用于购买产品B。"},
