"l55425":{"C":"引言"},
"l55426":{"C":"本协议的双方分别是您和Continental Exchange Solutions, Inc．（其营业名称为“RIA金融服务”），后者通过RIA的代理（“服务代理”）行事。表单中的条款是本协议的组成部分。"},
"l55427":{"C":"遵照本协议，位于“发汇人”指定国家的RIA网点将向您提供收取“发汇人”指定币种及金额的服务。对于该项服务，我们不向您收取费用。请注意，该项服务是针对个人收汇业务（发汇人认识您本人），不适用于商业性支付。"},
"l55428":{"C":"您必须签署本表单并且准确完整地填写其中需要您填写的部分。服务代理通常会要求您提供汇款的PIN码（您可向发汇人索取）。"},
"l55429":{"C":"您必须向服务代理提供其认可的有效身份证明。"},
"l5542":{"C":"尊敬的客户，您已提交加入全球账户管理的申请，但尚未被审批。若申请审批通过，则您可直接加入全球账户管理，无需单独申请开通全球账户管理服务。"},
"l55430":{"C":"我们的联络方式：电话400 890 6535（你用移动电话拨打此号码可能会产生费用）。我们的网站是riafinancial.com，我们的邮件地址为6565 Knott Ave. Buena Park. CA 90620. USA. email: chinacs@riafinancial.com。"},
