"l55432":{"C":"发汇人可能取消汇款"},
"l55433":{"C":"如果您的取款可能(a)使我们背离相关的法律、法规、法典或其他职责；(b)导致我们被政府或监管部门采取行动；或(c)与欺诈或不法活动有关，我们也可拒绝您的取款。"},
"l55434":{"C":"您可来电，我们将告知拒付的理由以及如何纠正导致我们拒付的错误（除非法律禁止告知）。如果发汇人希望（且法律允许），或者如果法律要求，我们将退还发汇人相应款项。"},
"l55435":{"C":"一般规定"},
"l55436":{"C":"如果汇款未正确处理或没有到款，我们可能对发汇人承担责任。我们无需对您承担任何责任，但本协议并不排除或限制我们按法律要求不得排除或限制的任何责任。"},
"l55437":{"C":"如果法律要求，我们将向有关政府部门报告汇款业务。"},
"l55438":{"C":"我们的任何服务均未要求您必须在我处（或任何其他协助汇款业务的公司）存款或开立存款账户。"},
"l55439":{"C":"本协议以及我们与您因订立本协议而产生的关系适用中华人民共和国的法律。"},
"l5543":{"C":"预留信息"},
"l55440":{"C":"本文件的部分条款是基于预期的监管要求（此等要求可能在本文件交付印制后才正式生效）。如果任何条款与监管要求不一致，我们将按监管要求执行该条款；我们再次印制本文件时将对该条款按监管要求进行必要的修订。（“监管要求”是指适用于我们的任何法律、法规、法典或产业指引。）"},
"l55441":{"C":"数据保护"},
"l55442":{"C":"我们致力于保护您的隐私。我们可能使用您的个人信息以及汇款详情，并将其存放于我们的数据库，以便我们向您提供汇款服务、管理我们的业务（包括与您的持续关系）以及开展适用法律所允许的市场调研。"},
"l55443":{"C":"为上述目的，我们可能与母公司和RIA的其他公司、服务代理以及其他服务提供商分享信息。除非法律有所要求，否则我们不会与其他人分享信息。我们己落实安全方面的惯例及程序，严格限制对个人信息的访问。"},
"l55444":{"C":"您可通过致函、致电或电邮我们，要求访问您的个人信息、对信息进行更正或更新或者依据正当理由反对有关您个人信息的处理。"},
"l55445":{"C":"完成并签署本表单即表示您同意我们因上述目的收集、使用和转发您的个人信息，包括转发给美国农业部和发汇国。我们的网站执行我们最新的数据保护政策，应法律要求我们将告知您此等政策的任何变化。"},
