"l56307":{"C":"交易指令：指甲方通过互联网向乙方发出的预授权、预授权撤销、预授权完成、退款等指示。"},
"l5630":{"C":"买二价"},
"l56311":{"C":"甲方通过乙方网站进行预授权订单在线支付时，乙方需对甲方身份信息进行核验。核验无误后完成订单预授权支付，同步为甲方正式开通“预授权支付”服务。"},
"l56312":{"C":"甲方申请开通“预授权支付”业务后，有权依本协议享受乙方提供的服务，并在本协议生效期间根据乙方相关业务规则对本协议项下“预授权支付”业务提出变更或关闭申请。"},
"l56313":{"C":"甲方在享受乙方提供的“预授权支付”业务时，应当遵守本协议以及乙方不定期通过网点、网站或电子银行等渠道公布的相关业务规则等要求。"},
"l56316":{"C":"甲方申请开通“预授权支付”服务，需同时遵守我行电子银行章程及相关业务规则。该章程、规则将通过网点、网站、网银等渠道进行不定时更新及公告，我行不再一一通知客户。"},
"l56317":{"C":"甲方应采取适当措施保护客户端交易的安全性，具体措施包括但不限于安装防病毒软件和电脑系统安全补丁、不在网吧等公共场所使用“预授权支付”服务等措施。"},
"l56318":{"C":"乙方应及时受理甲方相关“预授权支付”业务的申请，经审核符合条件的，应及时为甲方办理相关手续、提供相应服务。"},
"l5631":{"C":"买三价"},
"l56324":{"C":"乙方有权依据法律、法规、规章或业务需要对“预授权支付”业务服务内容、操作流程或收费标准等进行调整，涉及收费或客户其他权利义务变更的调整，应于正式对外公告后施行。如果甲方不同意接受乙方的调整内容，甲方有权向乙方申请终止“预授权支付”服务，但在申请终止相关服务之前甲方使用乙方服务的，仍然应当遵守相关调整内容。"},
"l56325":{"C":"乙方应当保障提供“预授权支付”服务的电子系统设施设备以及安全控制设施设备的安全。如果因不可抗力或其他非乙方原因造成交易无法完成以及由此导致的一切后果，乙方不承担任何责任。甲方可通过乙方网点或其他电子支付渠道完成相关交易。"},
"l56326":{"C":"甲方通过乙方规定的渠道申请“预授权支付”业务的，本协议自甲方通过相关渠道系统设置成功并开通“预授权支付”业务时生效。"},
"l56327":{"C":"甲方变更或关闭“预授权支付”业务，可根据乙方相关业务规定通过乙方网点或网站等渠道办理。"},
