"l5959":{"C":"第一条 中国银行网上银行中银e信服务是乙方为甲方提供的一种信息服务。甲方与乙方在线签订本协议后，乙方将通过发送手机短信或电子邮件（ email ）的方式，按照甲方定制的服务类别，为甲方提供服务。"},
