"l5960":{"C":"第二条 乙方有权根据网上银行业务发展需要扩充和调整 e 信服务的类别。"},
"l5961":{"C":"第三条 乙方在提供中银e信服务时，可能会对部分服务收取一定的费用，有关收费的具体信息，乙方会在相关页面的显要位置明确提示，如甲方选择了此类收费服务，乙方将会按照公示的收费标准向甲方收取费用。"},
"l5962":{"C":"第四条 甲方在使用乙方的中银e信服务前，应根据服务项目的发送方式预留手机号码或电子邮件地址，并且保证预留信息的准确。如果甲方预留信息不详细或不准确导致甲方无法收到信息而造成损失，乙方不承担任何责任。如果甲方的手机号码、电子邮件地址发生变更时，应及时通过网上银行进行修改，如果因甲方未及时进行修改，而无法收到 e 信服务信息所造成信息失密的，由甲方承担全部责任。"},
"l5963":{"C":"第五条 乙方中银e信服务信息在发送过程中，如果由于通讯故障或不可抗力等原因造成甲方未收到信息的，乙方不承担任何责任。"},
"l5964":{"C":"第六条 甲方可以终止使用中银e信服务。甲方如需终止使用中银e信服务，可以通过网上银行取消。"},
"l5965":{"C":"第七条 乙方应对甲方提供的手机号码、电子邮件地址等信息保密，但国家法律法规和规章另有规定的除外。"},
"l5966":{"C":"第八条 本协议受中华人民共和国法律约束。法律无明文规定的，可适用通行的金融惯例。"},
