"l6004":{"C":"甲方自愿在乙方开立基金交易账户，并向乙方申请办理乙方所代理的开放式基金的认购、申购、赎回基金单位等基金业务，并办理其他相关手续，甲方的上述基金业务交易申请是甲方根据相关基金的基金契约所规定发出的要求进行上述交易的要约。甲方同意乙方根据基金交易业务的需要自动为甲方到基金注册与过户登记机构办理基金账户开户手续，并同意提供相关基金注册登记机构所需的甲方开户资料。"},
"l6005":{"C":"甲方保证开户填写有关资料的内容真实、正确、完整、有效，当有关资料发生变化时，须及时到乙方办理更改手续。因甲方提供资料不实或更改不及时导致基金交易委托和其他手续不能正常进行时，甲方应自行承担责任。"},
"l6006":{"C":"乙方提供的各种基金业务交易申请适用于乙方代理销售的所有基金。但鉴于不同基金的交易规则并不完全相同，甲方通过填写网上银行所申请办理的相关基金业务及相关手续，可能只被基金管理公司部分接受，甲方某些申请事项可能会因不符合某些基金管理公司规定要求而被拒绝接受。甲方在填写各种基金业务申请之前，应仔细了解甲方申请交易的基金的交易规则，并且同意承担申请事项因不符合基金管理公司规定要求而被拒绝接受的全部后果。对申请中被接受的申请事项视为甲方的要约被接受。"},
"l6007":{"C":"鉴于甲方可能委托乙方办理多支基金的交易手续，不同基金的交易条件、手续可能因有关基金的基金契约、代销合同、登记过户规则的不同存在差异。甲方向乙方申请办理开立基金交易账户、认购、申购、赎回某一基金或设置分红方式等业务的行为，即表明甲方已认真阅读并理解基金的有关交易规则，自愿受其约束。"},
"l6008":{"C":"甲方在办理基金业务时，应确保在乙方同时开立指定资金账户，用于办理基金买卖的资金结算。基金交易账户未销户前，甲方不得撤销该资金账户。如甲方自行关闭资金账户，造成红利资金和赎回资金无法入账，甲方应自行承担责任。"},
"l6009":{"C":"只有在《中国银行个人网上银行投资服务协议》有效期间甲方才能够通过网上银行进行基金交易。甲方通过网上银行所进行的一切交易，乙方均视为甲方亲自办理。"},
