"l6146":{"C":"第二条 甲方自愿申请注册乙方网上银行，完全接受《中国银行股份有限公司电子银行章程》（以下简称章程）并遵守乙方相关业务规则和业务规定，经乙方审核通过同意后，有权根据注册项目享受相应的网上银行服务。"},
"l6147":{"C":"第三条 甲方已完全了解网上银行服务是乙方应用互联网方式提供的金融服务，甲方通过因特网使用网银服务可能会出现信息传送中断、停顿、延误、传送数据错误或存在一定的时差等情况，因上述情况造成网上银行服务被取消、暂停或终止，甲方应自行采取其它途径获取相关服务。"},
"l6148":{"C":"第四条 甲方必须保证其用于自助申请开办网上银行业务的资料均属真实、准确和完整。对于甲方未提供真实、准确、完整的资料或资料发生任何重大变更而没有及时通知乙方而造成的风险和损失由甲方承担。"},
"l6149":{"C":"第五条 甲方必须妥善保管用户名、密码、银行卡号、存折账号等信息。凡通过以上信息完成的网上银行服务指令，均视为甲方真实的意愿和行为的表示。因甲方泄露上述信息造成的损失，甲方承担全部责任。"},
"l0614":{"C":"收款银行全称应包括分支机构；请填写详细的收款银行地址"},
"l6150":{"C":"第六条 甲方应在乙方规定的服务时间内使用网上银行服务。"},
"l6151":{"C":"第七条 甲方同意乙方从其账户按照乙方公布的收费标准主动收取网上银行服务的相关费用。"},
"l6152":{"C":"第八条 乙方有权制定、调整和修改网上银行业务收费标准、收费方式和收费周期，甲方须按乙方制定的上述收费标准缴纳相应的服务费用。乙方上述收费标准、收费方式和收费周期的调整和修改将通过适当方式公告，不再逐一通知客户。"},
"l6153":{"C":"第九条 乙方应当保障网上银行系统设施设备以及安全控制设施设备的安全，对网上银行的重要设施设备和数据采取适当保护措施。在乙方履行上述合理义务前提下，因设备故障、通讯线路故障及断电、停电、病毒爆发或交易中偶发因素产生的不可预测、不可控制等因素，及不可抗力原因造成甲方损失时，乙方不承担任何经济和法律责任。"},
"l6154":{"C":"第十条 乙方具有对网上银行系统进行升级、改造的权利。因乙方对网上银行系统进行升级、改造而引起的服务取消、暂停或者客户账号、服务内容、项目、方式等变化，乙方将通过适当方式提前公告，不再逐一通知客户。"},
"l6155":{"C":"第十一条 乙方有权以公告的方式修改本协议条款和网上银行服务的有关规定，甲方如拒绝此修改，应在公告规定的合理时间内注销网上银行服务，否则表明甲方已同意此修改。"},
"l6156":{"C":"第十二条 本协议终止或服务超过有效期而中止时，乙方不退回甲方已支付的相关费用。"},
"l6157":{"C":"第十三条 乙方应对甲方提供的申请资料和账户信息等资料保密，但国家法律法规和规章另有规定的除外。"},
"l6158":{"C":"第十四条 乙方有义务为甲方提供网上银行服务的操作咨询服务。"},
"l6159":{"C":"第十五条 本协议受中华人民共和国法律约束。法律无明文规定的，可适用通行的金融惯例。"},
