"l6321":{"C":"*您的风险容忍程度非常低，在任何投资中，保护本金不受损失和保持资产的流动性是您的首要目标。您对投资的态度是希望投资收益极度稳定，不愿承担高风险以换取高收益，通常不太在意资金是否有较大增值，不愿意承受投资波动对心里的煎熬，追求稳定。您比较适合投资存款、债券、保本保收益或收益波动性较小的理财产品、保障型保险产品、保本基金和货币型基金。"},
"l6322":{"C":""},
"l6323":{"C":"风险测评旨在帮助您了解自己的风险偏好和风险承受能力，从而有助于您选择合适的产品投资。本测试以及资产配置建议可能并不全面和充分，最了解您的还是您自己。请您依据自己的财务状况、收入预期、对资金的流动性要求、对风险的厌恶程度及投资产品的特点等多种因素做出投资决策。请您在产品购买过程中注意核对自己的风险承受能力和产品风险的匹配情况，即使是最激进的客户，也建议您做好资产在不同风险等级产品间的配置工作。如需帮助，建议您联系您的理财经理或财富顾问，得到进一步的资产配置建议。"},
