"l6523":{"C":"七、乙方未按照本协议约定进行付款并造成甲方损失的，乙方应承担相应责任。但因以下原因造成付款请求未能支付，所造成的损失及风险由甲方承担：1.甲方付款账户余额不足；2.支付金额高于甲方设置的限额；3.付款账户状态不正常，如账户挂失、冻结、止付等；4.有权机关对账户执行冻结等措施；5.付款请求对相关支付业务有关要素及收款人户名、账号等事项记载不准确、不完整、不规范等。"},
