"l6826":{"C":"根据国家相关法律法规的规定，为维护双方利益，规范双方行为，甲乙双方本着自愿、平等、互利的原则，就甲方使用乙方网上银行协议支付服务签订如下协议："},
"l6827":{"C":"第一条 乙方提供的协议支付服务是甲方通过与乙方签订本协议，将甲方在乙方开立的账户（下称“甲方签约账户”）与甲方在商品或服务的销售方:  深圳银盛电子支付科技有限公司  （简称“商户端”）的账户进行绑定，即可在指定商户网站完成直接付款业务或查询业务。商户负责验证客户身份与服务权限。甲方授权乙方在收到商户端发送的划拨甲方签约账户资金的支付指令或查询甲方签约账户余额的查询指令后，直接依据该指令实时扣减甲方签约账户内的余额进行支付或返回甲方签约账户的余额信息。"},
"l6828":{"C":"第二条 甲方在与乙方签约之前必须已经与商户方完成了签约，注册了商户端账号。甲方在一个商户使用同一个商户端账户只能存在一个有效协议，不可重复签约。"},
"l6829":{"C":"第三条 甲方与乙方协议支付签约完成后生成协议号，该协议号是乙方按相关付款请求进行支付的依据，甲方应妥善保管协议号，并对以协议号完成的支付交易负责。因甲方对协议号保管不善或泄密造成的任何损失由甲方自行承担。请甲方在开通协议支付服务后，认真阅读相关的安全提示。"},
"l0682":{"C":"交易查询"},
"l6830":{"C":"第四条 甲方在签订本协议后，应按照乙方的业务要求指定用于协议支付的合法账户（即甲方签约账户），并设定支付限额。不同商户支持的账户类型不同。如支付金额超过甲方设定限额或乙方控制限额时，乙方有权拒绝支付。"},
"l6831":{"C":"第五条 甲方应保证用于协议支付的账户的支付能力，并严格遵守支付结算业务的相关法律法规。"},
"l6832":{"C":"第六条 如因甲方签约账户已销户或账户状态不正常（挂失、冻结等）、余额不足、支付金额高于甲方设置的限额等原因，导致乙方无法履行协议的，乙方不承担任何责任。"},
"l6833":{"C":"第七条 甲方与除甲乙双方之外的任何第三方机构（包括甲方所购买商品或服务的销售方等）之间的交易纠纷与乙方无关。乙方不受理甲方对其他任何第三方的投诉。"},
"l6834":{"C":"第八条 甲方通过在网上同意本协议并经过认证工具的认证后开通协议支付服务；甲方如需终止使用乙方提供的协议支付服务，可通过点击相关页面的解约功能撤销协议支付服务，也可从商户网站发起解约撤销协议支付服务。"},
"l6835":{"C":"第九条 本协议作为甲乙双方已经签署的电子银行（含网上银行）相关协议及其他既有协议和约定的补充部分而非替代文件，与其具有同样的法律效力。甲方在使用乙方提供的服务时应遵守乙方电子银行章程、业务规则和已签署的所有相关协议，以及其他相关的业务规定。"},
"l6836":{"C":"第十条 甲方发现自身未按规定操作，或由于自身其他原因造成协议支付指令未执行、未适当执行、延迟执行的，应及时通过拨打乙方客服电话或到营业网点通知乙方。乙方应积极调查并告知甲方调查结果。  甲方应确保所进行的交易真实合法，不得利用本协议项下的服务从事任何违法违规等行为。如甲方违反本协议，乙方有权中止或终止提供协议支付服务。"},
"l6837":{"C":"第十一条 因不可抗力、意外事件、不可预见的系统故障或其他非乙方原因（如设备故障、通讯线路故障及断电、停电等）造成的乙方没有正确执行甲方提交的协议支付指令或业务中断，乙方不承担任何责任。"},
"l6838":{"C":"第十二条 甲乙双方在履行本协议的过程中，如发生争议应协商解决，协商不成的，按照双方已经签署的电子银行（含网上银行）相关协议中的约定方式解决。"},
"l6839":{"C":"第十四条 本协议自甲方在网上同意并开通协议支付服务之时起生效，自撤销本服务之时起终止。所有时点均以乙方网上银行系统记录的时间为准。协议终止并不意味着终止前所发生的未完成交易指令的撤销，也不能消除因终止前的交易所带来的任何法律后果。 乙方变更业务或根据发展需要修改本协议的，乙方将通过适当方式（如电子银行渠道等）提前公告。若甲方不同意此修改，有权撤销本服务。若甲方仍继续使用本服务的，视为甲方接受该变更或修改。"},
