"l6840":{"C":"第十五条 乙方变更业务或根据发展需要修改本协议的，乙方将通过适当方式（如电子银行渠道等）提前公告。若甲方不同意此修改，有权撤销本服务。若甲方仍继续使用本服务的，视为甲方接受该变更或修改。"},
