"l6924":{"C":"保存为常用设备可将您的账号与该台设备进行关联，提高您的网银交易安全性。若您选择不保存为常用设备，在进行交易期间，可能需要提供附加的身份认证信息以确保交易真实性与安全性。"},
"l6925":{"C":"若您当前进行交易的设备是您个人私有设备，如个人笔记本电脑、手机、平板电脑等，我们推荐您保存为常用设备；若当前设备为公共设备，如办公室计算机、网吧计算机等，我们建议您不要选择保存。如有问题请咨询客服95566。"},
