"l7181":{"C":"甲方："},
"l7182":{"C":"为维护双方利益，规范双方行为，甲乙双方本着自愿、平等、互利的原则，就客户（以下简称“甲方”）使用中国银行股份有限公司（以下简称“乙方”）个人网上银行全球账户管理服务签订如下协议："},
"l7183":{"C":"第一条 定义"},
"l7184":{"C":"如无特别说明，下列用语在本协议中的含义为："},
"l7185":{"C":"网上银行服务：指乙方借助因特网技术为客户提供的金融交易服务和信息服务。"},
"l7186":{"C":"全球账户管理服务：是指甲方签约成为乙方的个人网上银行客户后，乙方向甲方提供的一种账户管理服务，甲方可通过此服务查询本人开立在国内及海外、已经关联至乙方网上银行中的账户的余额及交易明细。"},
"l7187":{"C":"第二条 甲方的权利与义务"},
"l7188":{"C":"权利"},
"l7189":{"C":"（一）甲方使用乙方提供的全球账户管理服务可查询甲方名下账户的余额及交易明细等。"},
"l0718":{"C":"产品说明书radio"},
"l7190":{"C":"（二）甲方对乙方的全球账户管理相关服务如有疑问、建议或意见时，可拨打乙方客户服务电话95566或登录乙方网站www.boc.cn进行咨询和投诉。"},
"l7191":{"C":"义务"},
"l7192":{"C":"（一）甲方申请全球账户管理服务时，必须遵守《中国银行电子银行章程》、《中国银行个人网上银行业务规则》和本协议。"},
"l7193":{"C":"（二）甲方申请全球账户管理服务时，必须在乙方开立了个人网上银行。"},
"l7194":{"C":"（三）甲方申请开通的全球账户管理服务只能管理甲方本人的账户。"},
"l7195":{"C":"乙方在线认证的以甲方用户名、密码、和认证工具（动态口令、USBKey等）所进行的一切交易，均视为甲方亲自办理，甲方对该交易负责。甲方应保证纳入全球账户管理服务的所有账户为其本人所有。"},
"l7196":{"C":"（五）甲方必须妥善保管本人的全球账户管理账号、安全认证工具等相关要素，并对通过以上要素完成的金融交易负责，由于上述要素泄露造成的损失由甲方自行承担。"},
"l7197":{"C":"（六）甲方保证将全球账户管理服务用于合法用途，并保证自己利用全球账户管理从事的各种交易为法律、法规所允许。"},
"l7198":{"C":"（七）甲方需遵守乙方相关费用收取的规定。"},
"l7199":{"C":"（八）甲方使用全球账户管理服务时，如使用的服务功能涉及到乙方其他业务规定或规则的需同时遵守。"},
"l0071":{"C":"WWW.BOC.CN"},
"l7200":{"C":"第三条 乙方的权利和义务"},
"l7201":{"C":"（一）乙方有权制定或调整全球账户管理服务的服务范围。"},
"l7202":{"C":"（二）乙方有权制定并调整全球账户管理的收费标准，并在乙方网上银行及营业网点等渠道进行公布，不再逐一对客户进行告知。"},
"l7203":{"C":"（三）乙方具有对全球账户管理服务进行升级、变更的权利。"},
"l7204":{"C":"（四）因不可抗力或供电、通讯、网络等非乙方原因导致全球账户管理服务不能正常使用的，乙方将视情况协助解决或提供必要的帮助，但不承担责任。对于在交易过程中，因暂时的网络通讯故障或其他原因造成的错账现象，乙方有权根据实际交易情况进行账务处理。"},
"l7205":{"C":"（五）乙方可根据法律规定向有权查询的法定机构提供客户资料，或为完成交易指令的需要向第三方提供必要的客户资料。乙方有权依照当地相关法律的规定协助国家司法机关或其他有权机关对甲方的全球账户管理服务进行查询、冻结和扣划"},
"l7206":{"C":"（六）乙方因以下情况没有正确执行甲方提交的网上银行业务指令时，不承担任何责任："},
"l7207":{"C":"１、乙方接收到的指令信息不明、存在乱码、不完整等。"},
"l7208":{"C":"２、甲方账户余额不足。"},
"l7209":{"C":"３、甲方账户内资金被依法冻结。"},
"l7210":{"C":"４、甲方未能按照乙方的有关业务规定正确操作。"},
"l7211":{"C":"５、其他不属于乙方过失的情况。"},
"l7212":{"C":"（七）甲方违反章程、协议、乙方的其他业务规定或利用全球账户管理服务从事非法活动的，乙方有权终止其使用该功能，并追究其法律责任。"},
"l7213":{"C":"（一）乙方向甲方提供全球账户管理服务查询余额、交易明细等功能和服务。"},
"l7214":{"C":"（二）乙方可在95566客户服务中心、乙方网上银行等渠道向甲方提供全球账户管理服务的咨询服务。"},
"l7215":{"C":"（三）乙方对甲方提供的申请资料和其他信息有保密的义务，但法律法规另有规定的除外。"},
"l7216":{"C":"（四）乙方不介入甲方与商户之间的交易纠纷，甲方不得以此为由对乙方提出异议。乙方可协助甲方查明网上银行交易等相关情况。"},
"l7217":{"C":"第四条 法律适用"},
"l7218":{"C":"（一）本协议受当地有关法律的约束，并依之进行解释。"},
"l7219":{"C":"（二）网上银行服务中发生的电子凭证和交易记录是确定交易真实和有效的依据。"},
"l0721":{"C":"周期性产品续约协议是由一系列同结构的、有固定期限的单期产品组成，各期产品的收益率会因市场原因具有一定的差异性。该业务采取一次签约、每期自动扣划资金方式。"},
"l7220":{"C":"第五条 争议的解决"},
"l7221":{"C":"本协议执行过程中遇有问题，由双方协商解决，如协商不成，向乙方所在地法院起诉。"},
