"l0756":{"C":"此款理财产品的风险级别高于您目前的风险承受能力，您不适宜购买此款产品。请您重新评估风险承受能力，审慎交易。"},
"l7570":{"C":"根据国家相关法律法规的规定，为维护双方利益，规范双方行为，甲乙双方本着自愿、平等、互利的原则，就甲方使用乙方个人网上银行专属理财账户服务签订如下协议："},
"l7571":{"C":"网上专属理财账户：指甲方通过乙方网上银行开通的、与甲方在乙方已签约活期账户（包括：借记卡、活期一本通、普通活期，下同）绑定的、专用于甲方本人在乙方网上银行中进行投资理财业务的虚拟账户。该网上专属理财账户无实体银行介质（指卡片或存折，下同），账户唯一、不可挂失。"},
"l7572":{"C":"甲方自愿开立乙方的网上专属理财账户，选择其在本人名下网上银行已签约的活期账户为唯一绑定账户。"},
"l7573":{"C":"甲方仅能申请一个网上专属理财账户；网上专属理财账户通过乙方网上银行开立，网上专属理财账户的开户机构默认与其第一次绑定的活期账户一致。"},
"l7574":{"C":"甲方用网上专属理财账户可享受到乙方提供的专属投资理财功能和服务。"},
"l7575":{"C":"网上专属理财账户可作为收款账户，即甲方本人或第三方可通过各种有效方式将资金转入网上专属理财账户；网上专属理财账户内资金不能直接用于各类转账支付或现金提取，甲方仅能通过本人网上银行将网上专属理财账户内的全额或部分余额定向转回到其绑定的活期账户，通过该绑定的活期账户进行转账支付或现金提取。"},
"l7576":{"C":"甲方可通过乙方提供的网上银行相关服务查询并变更本人网上专属理财账户状态（仅指客户绑定活期账户、解除与活期账户的绑定、将网上专属理财账户关联至乙方网上银行等）。"},
"l7577":{"C":"甲方对网上专属理财账户相关服务如有疑问、建议或意见，可拨打乙方客户服务电话95566或登录乙方网站www.boc.cn进行咨询和投诉。"},
"l7578":{"C":"甲方办理网上专属理财账户服务时，必须遵守《中国银行股份有限公司电子银行章程》、《中国银行股份有限公司个人网上银行业务规则》等业务规定和已签署的相关协议。对因甲方违反本协议或上述乙方相关章程、业务规则、安全须知和风险提示等而造成的损失和后果，由甲方承担责任。"},
"l7579":{"C":"甲方必须妥善保管本人的网上银行用户名、密码、网上专属理财账户账号、身份认证工具等相关要素，并对通过以上要素完成的金融交易负责，由于上述要素泄露造成的损失由甲方自行承担。甲方通过乙方网上银行所进行的一切经过身份认证工具认证后的交易，乙方均视为甲方本人办理。甲方不得要求变更或撤销已经提交的交易指令。"},
"l7580":{"C":"甲方使用网上专属理财账户办理乙方网上银行投资理财业务时，应按乙方规定限额要求执行。如甲方实际交易金额大于乙方规定限额，乙方有权拒绝执行相关交易指令。"},
"l7581":{"C":"甲方保证将网上专属理财账户用于合法用途，并保证本人利用网上专属理财账户从事的各种交易符合法律、法规及监管规定要求。"},
"l7582":{"C":"甲方需按照乙方对外公布的服务收费业务价格支付相关业务费用。"},
"l7583":{"C":"甲方使用网上专属理财账户时，如使用的服务功能涉及乙方其他业务规定或规则，需同时遵守。"},
"l7584":{"C":"乙方有权对网上专属理财账户按乙方对外公布的服务收费业务价格收取相关费用。"},
"l7585":{"C":"乙方具有对网上专属理财账户及相关服务进行升级、变更的权利。乙方业务变化或收费变更、或根据业务发展需要修改本协议，乙方将上述调整和修改以适当方式提前公告，不再逐一通知甲方。甲方如有异议，有权选择注销乙方个人网上专属理财账户服务，若甲方未注销相关服务或继续接受相关服务的，即视为甲方同意并接受该调整或修改，甲方办理相关业务须按调整或修改后的内容执行。"},
"l7586":{"C":"本协议所称“公告”指在中国银行营业网点及门户网站【http://www.boc.cn】等进行公告。"},
"l7587":{"C":"甲方原因导致网上专属理财账户不能正常使用的，乙方不承担相关责任或因此造成的损失，但乙方将为甲方提供必要的帮助并尽力协助甲方解决相关问题。对于在交易过程中，因暂时的网络通讯故障或其他原因造成的错账现象，乙方将根据实际交易情况进行账务处理。"},
"l7588":{"C":"乙方可根据法律法规、监管规定向有权查询的法定机构提供客户资料。乙方有权依照中华人民共和国相关法律法规的规定协助国家有权机关对甲方的网上专属理财账户进行查询、冻结和扣划。"},
"l7589":{"C":"乙方因以下情况没有正确执行甲方提交的网上银行业务指令时，不承担责任： 1、甲方账户余额或信用额度不足； 2、由于甲方账户状态不正常，如账户挂失、冻结、止付等； 3、甲方账户内资金被法定有权机构冻结或扣划； 4、 甲方的行为出于欺诈等恶意目的； 5、 甲方发出的交易指令缺乏必要的交易信息，或乙方接收到的指令信息不明、存在乱码、不完整等情况； 6、甲方未能正确依据乙方电子银行服务的各类业务规则、提示、服务说明进行操作； 7、 指令的执行会违反中国法律、法规或者监管当局的要求； 8、不可抗力或其他不可归因于乙方的原因。"},
"l7590":{"C":"乙方不介入甲方与第三方之间的交易纠纷，甲方不得以此为由对乙方提出异议。"},
"l7591":{"C":"甲方违反《中国银行股份有限公司电子银行章程》、《中国银行股份有限公司个人网上银行业务规则》或本协议、与乙方已签署的其他相关协议等或利用网上专属理财账户从事非法活动的，乙方有权终止其对网上专属理财账户的使用，并追究其法律责任。"},
"l7592":{"C":"乙方向甲方提供网上专属理财账户开立、投资理财、查询、余额定向转回等服务功能。"},
"l7593":{"C":"乙方可在95566客户服务中心、网上银行（http://www.boc.cn）等渠道向甲方提供网上专属理财账户及其关服务的咨询服务。"},
"l7594":{"C":"乙方对甲方提供的申请资料和其他信息有保密的义务，但下列情形除外： 1、经甲方同意或授权的。 2、乙方根据中国法律或其它适用法律法规规定有义务进行披露的情形，或根据司法、行政机构等有权机构要求的。 3、双方在其他协议中另有约定的。上述许可范围内的披露将可能会使相关第三方据此知悉相关信息，并依法为甲方提供服务或采取可能涉及甲方的行为。"},
"l7595":{"C":"本协议受中华人民共和国有关法律、法规的约束，并依之进行解释。"},
