"l8100":{"C":"银行本票/汇票申请提交后，请客户准确记录“申请确认码”，并于10个银行工作日内，携带本人有效身份证及银行卡/存折/现金等，到我行网点机构办理银行本票/汇票业务。银行柜台办理内容包括：客户身份审核、客户付款付费、银行为客户开立银行本票或银行汇票等。柜台办理时，请确保客户状态正常并余额充足。开立银行本票或银行汇票相关标准详询银行柜台。"},
