"l8130":{"C":"预约管理提供预约指令删除服务，只有尚未执行的预约指令可被删除，已执行的预约指令不论执行结果成功与否，均不可删除。当删除预约周期指令时，该预约周期内所有尚未执行的指令均将被删除。"},
