"l8139":{"C":"密码汇款是中国银行为您提供的一种新的汇款方式。您可通过网上银行、手机银行渠道发起汇款，预留收款人的手机号码和取款密码；汇款提交成功后，请将系统自动生成的汇款编号和预留密码告知收款人。收款人凭汇款编号、预留密码以及汇款时预留的手机号码收到的短信密码，即可办理取款。如收款人尚未取现或转账解付，您可以取消该笔密码汇款。"},
"l8140":{"C":"密码汇款仅限中国银行境内人民币汇款业务，汇款限额可通过“交易限额设置”功能在银行限额内自行设定。"},
"l8141":{"C":"您发起密码汇款时可设置“是否允许在ATM支取现金”，若为“否”，则收款人只能至中国银行营业网点柜台办理现金收款或转账解付，转账解付时须为收款人同名账户；若为“是”，则收款人可在柜台或ATM取款，但汇款金额须为100元的整数倍，且小于ATM机单笔取款金额。ATM机取款时请认准“中国银行”标识。"},
