"l8162":{"C":"存期不足3个月，按支取日挂牌活期储蓄利率计付利息；存期3个月以上（含3个月），不满半年，整个存期按支取日定期整存整取三个月利率打六折计息；存期半年以上（含半年）不满一年，整个存期按支取日定期整存整取半年期 利率打六折计息；存期在一年以上（含一年），无论存期多长，整个存期一律按支取日定期整存整取一年期利率打六折计息。"},
