"l8168":{"C":"教育储蓄是一种特殊的零存整取存款，适用于在校小学四年级（含四年级）以上的学生，享受优惠利率，更可获取额度内利息免税。网上银3.行教育储蓄须先在柜台开户，网上提供按月续存业务，支取须到柜台办理。"},
"l8169":{"C":"教育储蓄：教育储蓄是一种特殊的零存整取存款，适用于在校小学四年级（含四年级）以上的学生，享受优惠利率，到期支取时出示非义务教育的在校证明便可额度内利息免税。"},
"l0816":{"C":"协议申请日期"},
"l8170":{"C":"通知存款是一种不约定存期，支取时需提前通知银行，约定支取日期和金额方能支取的存款。"},
"l8171":{"C":"网上银行通知存款业务需先在柜台开立定期一本通账户。"},
