"l8173":{"C":"通知存款不论实际存期多长，按存款人提前通知的期限长短划分为一天通知存款和七天通知存款两个品种。一天通知存款必须提前一天通知银行约定支取存款，七天通知存款必须提前七天通知银行约定支取存款。"},
"l8174":{"C":"我行提供“约定转存通知存款”产品。该产品将比普通通知存款更具便捷性、收益性。如您尚未开办，建议您至我行营业网点或通过电子渠道进行签约办理。"},
"l8175":{"C":"起始日期可选择未来一个月内的任意一天/起始日期可以设置为未来一个月内的任意一天。"},
"l8176":{"C":"结束日期可选择未来六个月内的任意一天/结束日期可以设置为未来六个月内的任意一天。"},
"l8177":{"C":"您可通过通知管理对通知存款建立通知或对已建立的通知进行查看和撤销。"},
"l8178":{"C":"如客户选择此种支取方式，则在支取时只能到柜台进行通知存款支取；"},
"l8179":{"C":"如果客户一次性提取现金20万元（含）以上的，根据人民银行要求，至少应提前1天以上以电话等方式预约；"},
"l8180":{"C":"您选择的提款类别是手动转账，请您在支取日进行支取。"},
