"l8303":{"C":"如果您希望定期自动对某只理财产品进行申购或赎回交易，并自由设定交易方向、投资金额和投资频率，请点击“投资协议申请”，申请定时定额投资协议；如果您希望对某只理财产品自动进行申购或赎回交易，并使账户余额保持在设定的最高限额和最低限额之间，请点击“投资协议申请”，申请自动投资协议。"},
"l8304":{"C":"理财非存款、产品有风险、投资须谨慎"},
"l8305":{"C":"若您希望变更购买期数等自动续约协议内容或解除协议，请转至“周期性产品续约协议查询”页面操作或前往柜台办理。"},
"l8306":{"C":"如果您认购了多款同时成立的周期性产品，且理财资金帐户余额不足以认购所有产品，则银行自动为您优先购买认购日期在先的理财产品。"},
"l8307":{"C":"当您在下午15：30之后签约的周期非连续产品，系统将自动为您签至下一期。"},
