"l0830":{"C":"(基础金额模式为“定额”时显示)"},
"l8310":{"C":"如果您需要变更购买期数或解除协议，请转至“协议查询”页面操作或前往柜台办理。"},
"l8311":{"C":"组合购买方式指您持有已起息、允许被组合的产品A，用来购买其他未起息的理财产品B，B产品起息前您仍可获得A产品的收益。例如：加入您已持有已起息的开放式理财产品A，想购买正在销售的产品B，可以使用产品A的份额“组合购买”理财产品B。被组合产品A的将于B产品起息日赎回，并用于购买产品B。"},
"l8312":{"C":"被组合产品A的份额可以全额，也可部分用于购买B产品；B产品起息日，超出您认购B产品的部分A产品份额将自动赎回。"},
"l8313":{"C":"定时定额投资是指按照您设定的交易方向、交易金额、交易频率，自动定期购买或赎回您指定理财产品的投资方式；定投协议有效期以定投标的产品的存续期为限，且总期数最高不超过99期；定投金额须为追加认申购起点金额的整数倍，若您未持有此产品，定投金额不能低于认申购起点金额（以产品说明书为准）；定投频率可以选择“周”或“月”为单位，按照您输入的频率数自动进行投资，例如，若您输入“2周”，则系统从“定投开始日”开始，之后每两周为您按照约定的投资方式交易一次；若定投日为假日，系统将自动顺延至下一工作日为您执行定投；若因公共假日较长，致使单一协议的多个定投时间被顺延至同一工作日，系统仅为您执行一次定投；若您约定定期赎回产品，当您持有份额小于最低持有份额时，系统将自动赎回全部份额；请您在每期定投日之前在理财资金账户中预留不低于定投金额的认购资金，延时或预留资金不足的，视为本期定投无效。"},
"l8314":{"C":"自动投资是指根据自动投资协议规则，从自动投资开始日起每日自动检测客户账户余额，并依据协议约定的账户金额区间进行申购或赎回指定理财产品的交易方式，例如：当您的账户余额高于“最高限额”时系统将自动将高出限额的部分购买理财产品，当您的账户余额低于最低限额时，系统将自动赎回理财产品使客户的余额恢复至最低限额之上；自动投资协议有效期以定投标的产品的存续期为限，且总期数最高不超过366期；自动投资交易遵循理财产品交易开放时间；自动投资金额须同时满足产品起点金额、最低追加认购金额以及最低持有份额等限制条件。"},
"l8315":{"C":"如果您希望变更定投协议内容、暂停、继续协议或撤销协议，请转至“协议查询”页面操作或前往柜台办理。"},
"l8316":{"C":"认购产品容许当日或者隔日撤单(以产品说明书为准)。"},
"l8317":{"C":"您可选择起止日期查询最近一年内的历史交易，每次查询最大时间间隔为三个月，如有其他查询需求，请到柜台办理。"},
"l8318":{"C":"若您需要查询普通交易、投资协议交易、挂单交易等常规交易，请在“交易类型”选择“常规交易”查询。若您的组合购买交易已经全部或部分成交，需要查询被组合产品的赎回交易、组合购买产品的认/申购交易，也在此处查询。"},
"l8319":{"C":"若您查询的是挂单交易，交易状态为“挂单委托”时，表示您挂单申请成功，系统等待发起挂单申请的交易；交易状态为“正常”时，表示您挂单申请的交易已经成功发起。"},
