"l8321":{"C":"如您以现钞和现汇购买同一款理财产品，该款理财产品的现钞和现汇购买余额将被分别显示，赎回时，如该款产品要求全部赎回，则您进行现钞或现汇其中之一的赎回系统都将视同该款理财产品被全部赎回。"},
"l8322":{"C":"选择“定时定额投资协议”后，如果您需要变更定投期数、定投金额、定投频率等定投协议内容，请点击“修改”；如果您需要撤销此协议，请点击“撤销”；如果您需要暂停此协议的执行，请点击“暂停”，如果您需要恢复已暂停的协议，请点击“继续”。"},
"l8323":{"C":"选择“自动投资协议”后，如果您需要变更投资期数、最低限额、最高限额等自动投资协议内容，请点击“修改”；如果您需要撤销此协议，请点击“撤销”；如果您需要暂停此协议执行，请点击“暂停”；如果您需要恢复已暂停的协议，请点击“继续”。"},
"l8324":{"C":"选择“定时定额投资协议”后，如果您需要变更定投期数、定投金额、定投频率等定投协议内容，请点击“修改”；如果您需要撤销此协议，请点击“撤销”；如果您需要暂停此协议的执行，请点击“暂停”，如果您需要恢复已暂停的协议，请点击“续约”。"},
