"l8331":{"C":"您可通过本功能对网上专属理财账户的状态进行查询，同时实现：对绑定不成功的网上专属理财账户进行自助绑定；对关联网上银行不成功或已经取消关联网上银行的网上专属理财账户进行自助关联；对已经绑定并关联网上银行的账户进行解绑后重新绑定。"},
