"l8361":{"C":"您提交基金卖出申请后，请在第3-4个工作日通过“交易状况”功能查询成交状况，确认是否卖出成功。3.您当日有效交易为北京时间每周一至周五9：00-15：00，当日交易必须在当日15点前撤单；您15点以后的（认购交易除外）交易属于挂单交易；超过16点的认购交易也属于挂单交易。节假日期间所有交易均为挂单交易。"},
