"l8374":{"C":"注：选择意向营业部后，您可以在该证券公司同城任一家营业部办理开户。因监管机构要求须至证券公司营业部现场开立证券资金账户，如您选择的证券公司营业部与您的借记卡不在同省，请确认后续可亲至您选定的营业部办理激活手续。"},
