"l8377":{"C":"第三方存管预指定确认，是指您在证券公司办理证券资金账户开户以及选择办理第三方存管业务的银行后，通过所选银行的营业柜台、自助终端或网上银行进行确认。办理确认手续后，您可以使用银行渠道（网上银行、电话银行、手机银行、自助终端等）以及证券公司渠道进行转账（从证券公司渠道进行银行转证券需要开通电话银行服务）。"},
"l8378":{"C":"银行和证券公司双方在证券交易日营业时间内受理预指定确认申请，营业时间一般为8：30-16：00。非上述时间段的预指定确认交易可能失败，敬请谅解。"},
