"l8444":{"C":"试算规则:"},
"l8445":{"C":"（1） 买入金额是指认购，申购，定投申购，转换转入，转托管转入，非交易过户转入的基金金额（含手续费）；"},
"l8446":{"C":"（2）卖出金额是指赎回、转换转出、转托管转出、非交易过户转出的基金金额净额（不含赎回手续费）；"},
"l8447":{"C":"（3）交易费用是指在基金产品买卖过程中，销售机构依据实际约定的手续费率提取的手续费佣金；"},
"l8448":{"C":"（4）已实现盈亏=现金红利收益+累计卖出份额*（卖出份额净均价-买入份额成本均价）；"},
"l8449":{"C":"（5）持仓盈亏=期末持仓份额*（期末净值-买入份额成本均价）；"},
"l0844":{"C":"在“组合购买”交易发生后，被组合产品A的份额将无法主动赎回；如您想赎回A产品份额，请在“交易状况”页面撤销“组合购买”交易。"},
"l8450":{"C":"（6）总盈亏=持仓盈亏+已实现盈亏=期末市值-期初市值+卖出净金额-买入总金额；"},
"l8451":{"C":"（7）买入份额成本均价=｛期初市值+期间净值类交易确认金额+份额类交易确认份额*确认日基金净值｝/｛期初份额+期间累计买入份额+期间累计转入份额+分红再投资份额｝；"},
"l8452":{"C":"（8）卖出份额净均价={（累计赎回金额-累计赎回费用）+（累计转出、转托管、非交易过户份额、强减份额*当天成交净值）}/累计交易份额。"},
"l8453":{"C":"您可以对当前持仓的支持浮动盈亏试算的基金进行试算，试算时间范围最长为三年；"},
