"l8455":{"C":"由于小数位的取舍关系，可能致使总盈亏数据与分项数据之和存在微小差异，属正常现象；"},
"l8456":{"C":"本页所展示的浮动盈亏数据仅代表中国银行根据合理审慎的原则，依据与产品管理人的交换数据进行估算，并不确保数据的完备性和准确性，展示结果仅供您参考，并不构成任何意义的投资建议，投资人据此进行投资操作，本行概不负责。如有疑问，请致电我行客服热线95566或您的客户经理。"},
