"l8500":{"C":"障碍式牛熊证是客户买入相应的障碍式看涨、看跌期权，以期在到期日获得相应收益。该类期权合约是以汇率为标的物、标准化期限和交易面值的带有障碍条件的欧式期权。"},
"l8501":{"C":"在障碍式牛熊证到期前，如市场汇率波动从未触及敲出条件或已触及敲入条件，该期权到期时，按照普通欧式期权处理，即：如果执行价格优于市场汇率，则银行统一为客户执行期权，并通过轧差交易将客户收益体现至客户账户；如果汇率变动对客户不利，则银行统一为客户放弃执行期权。如市场汇率波动触及敲出条件或从未触及敲入条件，该期权被提前终止，到期时不产生任何交割。"},
