"l8577":{"C":"如果您需要定期自动对某只理财产品进行申购或赎回交易，并自由设定交易方向、投资金额和投资频率，请点击“投资协议申请”，申请定时定额投资协议；如果您希望对某只理财产品自动进行申购或赎回交易，并使账户余额保持在设定的最高限额和最低限额之间，请点击“投资协议申请”，申请自动投资协议。"},
