"l8580":{"C":"如影响您风险承受能力的因素发生变化，请及时完成风险承受能力评估"},
"l8581":{"C":"定时定额投资是指按照您设定的交易方向、交易金额、交易频率，自动定期购买或赎回您知道理财产品的投资方式；定投协议有效期以定投标的产品的存续期为限，且总期数最高不超过99期；定投金额须为追加认申购起点金额的整数倍，若您未持有此产品，定投金额不能低于认申购起点金额（以产品说明书为准）；定投频率可以选择“周”或“月”为单位，按照您输入的频率数自动进行投资，例如，若您输入“2周”，则系统从“定投开始日”开始，之后每两周为您按照约定的投资方式交易一次；若您约定定期赎回产品，当您持有份额小于最低持有份额时，系统将自动赎回全部份额；请您在每期定投日之前在理财资金账户中预留不低于定投金额的认购资金，延时或预留资金不足的，视为本期定投无效。"},
"l8582":{"C":"自动投资是指根据自动投资协议规则，从自动投资开始日起每日自动检测客户账户余额，并依据协议约定的账户金额区间进行申购或赎回指定理财产品的交易方式，例如:当您的账户余额高于“最高限额”时系统将自动将高出限额的部分购买理财产品，当您的账户余额低于最低限额是，系统将自动赎回理财产品使客户的余额恢复至最低限额之上；自动投资协议有效期以定投标的产品的存续期为限，且总期数最高不超过366期；自动投资交易遵循理财产品交易开放时间；自动投资金额须同时满足产品起点金额、最低追加认购金额以及最低持有份额等限制条件。"},
