"l8616":{"C":"1.风险测评旨在帮助您了解自己的风险偏好和风险承受能力，从而有助于您选择合适的产品投资。本测试以及资产配置建议可能并不全面和充分，最了解您的还是您自己。请您依据自己的财务状况、收入预期、对资金的流动性要求、对风险的厌恶程度及投资产品的特点等多种因素做出投资决策。请您在产品购买过程中注意核对自己的风险承受能力和产品风险的匹配情况，即使是最激进的客户，也建议您做好资产在不同风险等级产品间的配置工作。如需帮助，建议您联系您的理财经理或财富顾问，得到进一步的资产配置建议。"},
"l8617":{"C":"2.您提供的信息应当真实、准确、完整，我们的风险评价将基于您提供的有效信息，如因您提供虚假、无效或不完整地信息，导致的评价结果出现错误，银行不承担相应责任。"},
