"l8653":{"C":"密码汇款业务是汇款人登录中国银行网上银行办理汇款时，银行系统为汇款人生成不重复的汇款编号，然后汇款人自行将汇款编号和解付密码告知指定的收款人，收款人凭汇款编号以及汇款人指定的验证方式（解付密码及手机验证码）办理收款的一项业务。"},
