"l87494":{"C":"请阅读页面下部温馨提示，了解各房屋结构说明。"},
"l87495":{"C":"钢结构是以钢材制作为主的结构，是主要的建筑结构类型之一。特点是由型钢和钢板等制成的钢梁、钢柱、钢桁架等构件；各构件或部件之间采用焊缝、螺栓或铆钉连接的结构，是主要的建筑结构类型之一。"},
"l87496":{"C":"钢筋混凝土结构是指用配有钢筋增强的混凝土制成的结构。承重的主要构件是用钢筋混凝土建造的。包括薄壳结构、大模板现浇结构及使用滑模、升板等建造的钢筋混凝土结构的建筑物。用钢筋和混凝土制成的一种结构。钢筋承受拉力，混凝土承受压力。具有坚固、耐久、防火性能好、比钢结构节省钢材和成本低等优点。"},
"l87497":{"C":"混合结构是相对于指单一结构如砼、木结构、钢结构而言的，是指多种结构形式总和而成的一种结构。最常用的是钢筋混凝土和砖木的混合。"},
