"l87499":{"C":"砖木结构,房屋的一种建筑结构·指建筑物中竖向承重结构的墙、柱等采用砖或砌块砌筑，楼板、屋架等用木结构。由于力学工程与工程强度的限制，一般砖木结构是平层(1-3层)。"},
