"l8759":{"C":"一、 开户预约业务说明"},
"l8760":{"C":"第三方存管预约开户（以下简称“预约开户”），是指有证券投资意向的客户通过银行营业网点或电子银行登记预约信息，委托银行将相关信息发送证券公司进行开户预约，然后本人到证券公司营业部进行身份核实、确认并签署相关文件，证券公司审核无误再与银行一并开通第三方存管服务。"},
"l8761":{"C":"签署本须知则代表您同意通过中国银行的营业网点或电子银行进行第三方存管预约开户信息的登记，并同意由中国银行将相关信息发送证券公司进行开户预约。但不代表您委托银行作为代理人在证券公司进行预先开户，也不代表发出预约申请后证券公司为您直接开户。"},
"l8762":{"C":"二、  预约及后续手续说明"},
"l8763":{"C":"（一）  预约：指定用于第三方存管的银行账户（借记卡）、身份信息及联系信息，选择意向证券公司和营业部门。请务必准确填写，并在证券公司端进行确认时使用一致的信息。"},
"l8764":{"C":"（二）  开通：在预约成功后，必须前往证券公司营业部进行身份核实、确认，并签署相关文件后，才能开通各类账户用于银证转账和证券投资。在办理身份核实、确认等手续前请向预约营业部电话咨询开户注意事项及所需开户文件。"},
"l8765":{"C":"三、  其它说明"},
"l8766":{"C":"（一）  预约有效期"},
"l8767":{"C":"预约有效期为自预约之日起3个月，请您在规定时间内亲自前往证券公司营业部办理身份确认等手续。如果未在有效期内前往证券公司办理相关业务，则该预约自动失效，需再次办理新的开户预约。"},
"l8768":{"C":"（二）  密码"},
"l8769":{"C":"在证券端开通第三方存管服务时，您需要输入电话银行密码以便银行进行身份核实。为确保您正常进行开户预约，如您尚未开通电话银行，请您提前办理开通手续。"},
"l8770":{"C":"（三）  签署第三方存管“三方协议”"},
"l8771":{"C":"您在证券端开通第三方存管服务时，需要签署《客户交易结算资金第三方存管协议书》。"},
