"l0912":{"C":"定时定额投资是指按照您设定的交易的交易方向、交易金额、交易频率，自动定期购买或赎回您指定理财产品的投资方式；定投协议有效期以定投标的产品的存续期为限，且总期数最高不超过99期；定投金额须为追加认申购起点金额的整数倍，此若您持有产品，定投金额不能低于认申购起点金额（以产品说明书为准）定投频率可以选择“周”或“月”为单位，按照您输入的频率数自动进行投资，例如，若您输入“2周”，则系统从“定投开始日”形始，之后每两周为您按照约定的投资方式交易一次；若定投资日为假日，系统将自动顺延至下一工作日为您执行定投；若因公共假日较长,致使单一协议的多个定投时间被顺延至同一工作日，系统仅为您执行一次定投；若您约定定期赎回产品，当您持有份额小于最低持有份额时，系统将自动赎回全部份额；请您在每期定投日之前在理财资金账户中预留不低于定投金额的认购资金，延时或预留资金不足的，视为本期定投无效。"},
