"l0913":{"C":"自动投资是指根据自动投资协议规则，从自动投资开始日起每日自动检测客户账户余额，并依据协议约定的账户金额区间进行申购或赎回指定理财产品的交易方式，例如：当您的账户余额高于“最高限额”时系统自动将高出限额的部分购买理财产品，当您的账户余额低于最低限额时，系统将自动赎回理财产品使客户的余额恢复至最低限额之上；自动投资协议有效期以定投标的产品的存续期为限，且总期数最高不超过366期；自动投资交易遵循理财产品交易开放时间；自动投资金额须同时满足产品起点金额、最低追加认购 金额以及最低持有份额等限制条件。"},
