"l9168":{"C":"2、我们按照您设置的约定还款金额提供部分扣款及再次扣款服务。（1）部分扣款服务：当关联还款账户不能足额偿还约定的还款金额时，以您关联还款账户的可转账余额作为还款金额进行扣款。（2）再次扣款服务：在首次自动还款未满足约定的还款金额时，在还款宽限期届满日当天再次从您关联还款账户扣款。若关联还款账户仍不能足额偿还约定的自动还款金额时，以您关联账户的可转账余额作为还款金额进行扣款。"},
"l9170":{"C":"3、如勾选“所有结欠均以人民币还款”即可轻松享有自动购汇还款服务。如您关联的还款账户为长城信用卡，汇率为扣款日当天我行对外公布的外汇牌价，其他还款账户则为扣款日前一天我行对外公布的外汇牌价。"},
"l9171":{"C":"4、如您不需要购汇还款，则可勾选“人民币与外币结欠分别以相应账户还款”（还款账户为活期一本通的，人民币与外币扣款账户可为同一账户）。我们按照先钞后汇的顺序检查还款账户的余额，并在最先有足够余额的账户扣款。当您关联的还款账户均不能足额偿还约定的金额时，我们将最先选择钞户或汇户中余额较大的账户进行扣款。"},
"l9172":{"C":"5、开通自动还款服务后我们将在对账单中提示您已开通自动还款功能，并提供您预先指定的还款账号，方便您及时核对。为避免因还款失败而造成不必要的损失，请您在到期还款日及再次扣款日前检查还款账户并存入足够资金。我行保留由于还款账户余额不足、卡账号错误、证件不符、账户异常等原因拒绝自动还款的权利。"},
"l9174":{"C":"6、如您开通短信服务，每月我们将通过短信告知您自动还款的结果，请您及时查对。如自动还款失败，还请您及时主动通过其他方式办理还款业务。同时，自动还款成功或失败记录也会记入您的账单中，以供核对。"},
