"l92662":{"C":"甲方： {0}"},
"l92663":{"C":"乙方：中国银行股份有限公司"},
"l92664":{"C":"第一章 基本定义"},
"l92665":{"C":"第一条 “存管业务”，指乙方为甲方所签约的交易所开立客户交易结算资金专用存款账户，按照甲方和交易所的要求完成客户交易结算资金划转、清算等支付结算服务。"},
"l92666":{"C":"第二条 “交易商”，即甲方，指具有良好资信，经交易所审核批准获得交易商资格，通过交易平台从事产（股）权/大宗商品（据实选择，二选一）投资交易的企业法人、其他经济组织或者自然人。"},
"l92667":{"C":"第三条 “交易日”，指可以在交易所交易平台进行投资交易的日期。 “交易时间”，指每一个交易日内可以进行投资交易的时间。交易日及交易时间由乙方与交易所协商确定，并对外公布。"},
"l92668":{"C":"第四条 “保证金”，即“客户交易结算资金”，指甲方存放于交易所的用于结算和担保合同履行的资金。"},
"l92669":{"C":"第五条 “银行结算账户”指甲方在乙方开立的，用于交易资金往来结算的银行存款账户。"},
"l92670":{"C":"第六条 “交易保证金账户”指乙方为甲方签约的交易所开立的，用于归集投资客户交易保证金的专用账户，其账户用途为客户交易结算资金专用存款账户。"},
"l92672":{"C":"第七条 “资金账户”指甲方在交易所开立的专门用于产（股）权/大宗商品（据实选择，二选一）交易用途的账户，形成交易所对甲方的负债，与甲方在乙方开立的客户交易结算资金簿记台账和银行结算账户一一对应。交易所通过该账户对甲方出入金、清算交收和计付利息等交易进行前端控制，并应对甲方资金账户中的交易结算资金安全负责。"},
"l92673":{"C":"第八条 “客户交易结算资金簿记台账”指乙方为甲方开立的，用于记载甲方产（股）权/大宗商品（据实选择，二选一）交易结算资金变动情况的台账，该簿记台账不构成乙方对甲方的负债义务。该台账与甲方的银行结算账户和交易所保证金账户之间建立一一对应关系。"},
"l92676":{"C":"第九条 “入金”，指乙方依照甲方或甲方通过交易所发起的指令将资金从甲方银行结算账户划入交易所交易保证金账户，并由甲方同步更新其资金账户。"},
"l92677":{"C":"第十条 “出金”，指乙方依照甲方或甲方通过交易所发起的指令将资金从交易所保证金账户划转至甲方银行结算账户，并由甲方同步更新其资金账户。"},
