"l9819":{"C":"第一条 电子银行个人客户在线申请开立活期或定期账户是指中国银行依托于互联网络向个人客户提供的一种便捷的申请开立活期一本通或定期一本通账户的服务。"},
"l0981":{"C":"理财产品交易将产生手续费用，请关注产品说明书中的具体费率。"},
"l9820":{"C":"第二条 个人客户可通过中国银行电子银行（包括个人网上银行、手机银行、家居银行）申请开立一个或多个活期或定期账户，且该账户只能关联在客户已签约电子银行的借记卡下。"},
"l9821":{"C":"第三条 申请人通过中国银行电子银行开立的活期或定期账户可享受到中国银行个人网上银行、手机银行及家居银行提供的相应功能和服务，在使用过程中需遵守电子银行服务有关业务规则及已签署过的电子银行相关服务协议。"},
"l9822":{"C":"第四条 申请人保证将申请开立的活期或定期账户用于合法用途，并保证本人利用电子银行开立的活期或定期账户从事的各种交易符合法律、法规及监管规定要求。"},
"l9823":{"C":"第五条 申请人确认已理解上述须知相关含义，并自愿申请办理中国银行电子银行个人客户在线开立活期或定期账户服务，如对该服务有疑问、建议或意见，可拨打中国银行客户服务电话95566进行咨询和投诉。"},
