"l0982":{"C":"中国银行股份有限公司个人理财产品总协议书"},
"l9830":{"C":"中国银行股份有限公司“中银快付”客户服务协议"},
"l9831":{"C":"为明确甲乙双方权利与义务关系，规范双方行为，“中银快付”<strong>业务服务申请人（以下简称“甲方”）与中国银行股份有限公司（以下简称“乙方”）</strong>就中国银行“中银快付”服务的相关事宜达成协议如下："},
"l9832":{"C":"“中银快付”服务：指由乙方通过互联网渠道提供的，甲方在乙方支付服务页面输入银行卡号、银行卡密码、手机号、身份证件信息等要素进行首次注册，之后历次通过银行卡号和手机交易码认证方式进行小额电子支付结算的服务。"},
"l9833":{"C":"认证工具：包括但不限于USBKey数字安全证书、动态口令牌、手机交易码短信等由乙方提供的对客户进行身份认证的工具。"},
"l9834":{"C":"交易指令：指甲方通过互联网向乙方发出的服务开通、预留信息修改、支付、服务关闭等指示。"},
"l9835":{"C":"错误：指乙方未能执行、未能及时执行或未能正确执行甲方交易指令的情况。"},
"l9836":{"C":"服务申请与内容"},
"l9837":{"C":"服务开通"},
"l9838":{"C":"甲方通过乙方网站自助登记甲方个人基本信息及账户信息，申请开通“中银快付”服务。乙方需对甲方身份信息进行核验。核验无误后为甲方正式开通“中银快付”服务。"},
"l9839":{"C":"服务内容"},
"l0983":{"C":"定时定额"},
"l9840":{"C":"甲方开通“中银快付”服务后，可享受的服务包括：服务开通、网上小额支付、预留信息设置与修改、服务关闭等服务。"},
"l9841":{"C":"甲方权利与义务"},
"l9842":{"C":"甲方申请开通“中银快付”业务后，有权依本协议享受乙方提供的服务，并在本协议生效期间根据乙方相关业务规则对本协议项下“中银快付”业务提出变更或关闭申请。"},
"l9843":{"C":"甲方在享受乙方提供的“中银快付”业务时，应当遵守本协议以及乙方不定期通过网点、网站或电子银行等渠道公布的相关业务规则等要求。"},
"l9844":{"C":"甲方应保证其提供的个人资料的真实、完整、有效。对于手机号等重要信息，如有变更，应及时通过乙方网点等渠道办理变更手续。因甲方个人资料不真实、不正确、不完整等原因而发生的风险和责任由甲方承担。"},
"l9845":{"C":"甲方必须妥善保管银行卡、银行卡密码和认证工具（具体内容请见本协议第一条的相关规定），不得将银行卡、银行卡密码和认证工具交于任何人 （包括乙方工作人员）使用。使用上述认证工具所完成的一切交易操作均视为甲方本人所为，甲方应对由此产生的后果负责。"},
"l9846":{"C":"如甲方的银行卡、认证工具发生遗失、被盗或银行卡密码泄露等可能导致甲方账户安全性降低的情形,甲方应立即对相关银行卡或认证工具进行挂失或关闭相关服务，在挂失或终止生效之前发生的损失均由甲方承担。"},
"l9847":{"C":"甲方在交易过程中必须核对手机短信交易码信息是否与当前交易一致，核对无误后再输入交易码进行确认。否则由此造成的一切损失由甲方承担。"},
"l9848":{"C":"甲方申请开通“中银快付”服务，需同时遵守我行电子银行章程及相关业务规则。该章程、规则将通过网点、网站、网银等渠道进行不定时更新及公告，我行不再一一通知客户。"},
"l9849":{"C":"甲方应采取适当措施保护客户端交易的安全性，具体措施包括但不限于安装防病毒软件和电脑系统安全补丁、不在网吧等公共场所使用“中银快付”服务等措施。"},
