"l9850":{"C":"乙方权利与义务"},
"l9851":{"C":"乙方应及时受理甲方相关“中银快付”业务的申请，经审核符合条件的，应及时为甲方办理相关手续、提供相应服务。"},
"l9852":{"C":"乙方有权依据法律、法规、规章或业务需要对“中银快付”业务服务内容、操作流程或收费标准等进行调整，涉及收费或客户其他权利义务变更的调整，应于正式对外公告后施行。如果甲方不同意接受乙方的调整内容，甲方有权向乙方申请终止“中银快付”服务，但在申请终止相关服务之前甲方使用乙方服务的，仍然应当遵守相关调整内容。"},
"l9853":{"C":"乙方应当保障提供“中银快付”服务的电子系统设施设备以及安全控制设施设备的安全。如果因不可抗力或其他非乙方原因造成交易无法完成以及由此导致的一切后果，乙方不承担任何责任。甲方可通过乙方网点或其他电子支付渠道完成相关交易。"},
"l9854":{"C":"属乙方工作差错并导致支付结算处理延误对乙方造成损失的，乙方有责任按中国人民银行《支付结算办法》等有关规定赔偿。乙方因以下情况没有正确执行甲方提交的交易指令，不承担任何责任："},
"l9855":{"C":"甲方账户余额或信用额度不足；"},
"l9856":{"C":"甲方账户内资金被法定有权机构冻结或扣划；"},
"l9857":{"C":"甲方的行为出于欺诈等恶意目的；"},
"l9858":{"C":"甲方发出的交易指令缺乏必要的交易信息，或甲方接收到的指令信息不明、存在乱码、不完整等情况；"},
"l9859":{"C":"甲方未能正确依据甲方电子银行服务的各类业务规则、提示、服务说明进行操作；"},
"l0985":{"C":"买回"},
"l9860":{"C":"指令的执行会违反中国法律、法规或者监管当局的要求；"},
"l9861":{"C":"不可抗力或其他不可归因于甲方的原因。"},
"l9862":{"C":"乙方应对甲方资料进行保密，但法律法规及金融监管机构另有规定、甲方与乙方另有约定或在乙方内部使用的除外。"},
"l9863":{"C":"争议解决"},
"l9864":{"C":"双方在履行本协议过程中，如发生争议，应协商解决。协商解决不成的，任何一方均可向乙方所在地人民法院提起诉讼。"},
"l9865":{"C":"协议的生效、变更、中止和终止"},
"l9866":{"C":"甲方通过乙方规定的渠道申请“中银快付”业务的，本协议自甲方通过相关渠道系统设置成功并开通“中银快付”业务时生效。"},
"l9867":{"C":"甲方变更或关闭“中银快付”业务，可根据乙方相关业务规定通过乙方网点或网站等渠道办理。"},
"l9868":{"C":"甲方完成乙方“中银快付”业务的关闭手续时，本协议即为终止。在甲方违反本协议规定或其他乙方业务规定的情况下，乙方有权中止或终止本协议。协议终止并不意味着终止前所发生的未完成交易指令的撤销，也不能消除因终止前的交易所带来的任何法律后果。"},
"l9869":{"C":"本协议的成立、生效、履行和解释，均适用中华人民共和国法律，法律无明文规定的，可适用通行的金融惯例。"},
